(2, 1, 2, 'UXQFRTYE2WMYUJSEUVSBBEMGE6P8D75ORGRM2FSD41BD3RMCMZ9PTAFYKGJHSKPN5FSF', '<div class=\" tm-timeline-item\">\r\n                    <div class=\"tm-timeline-item-inner\">\r\n                      <img src=\"https://news-cdn.softpedia.com/images/news2/gentlemen-here-s-what-it-means-if-the-ladies-laugh-at-your-jokes-490963-2.jpg\" alt=\"Image\" class=\"rounded-circle tm-img-timeline responsive\">\r\n                      <div class=\"tm-timeline-connector\">\r\n                      <p class=\"mb-0\">&nbsp;</p>\r\n                      </div>\r\n                      <div class=\"tm-timeline-description-wrap\">\r\n                          <div class=\"tm-bg-dark tm-timeline-description\">\r\n                                <h3 class=\"tm-text-green tm-font-400\">\r\n                                What women say What women mean\r\n                                </h3>\r\n                                <p style=\"color:white;font-weight:bold;\">\r\n                                    FINE: This is the word women use to end an argument when they feel they are right and you need to shut up. Never use \"fine\" to describe how a woman looks. This will cause you to \r\nhave one of \"those\" arguments.\r\n                                \r\n                                </p>\r\n                                <p class=\"tm-text-green float-left mb-0\">\r\n                                 Sure enough  Create on 16/09/2019.\r\n                                </p>\r\n                                <div class=\"float-right\">\r\n                                  <a href=\"http://127.0.0.1/see-git2019/article/read/UXQFRTYE2WMYUJSEUVSBBEMGE6P8D75ORGRM2FSD41BD3RMCMZ9PTAFYKGJHSKPN5FSF\" class=\"btn btn-primary\">Read More</a>\r\n                                </div>\r\n                          </div>\r\n                    </div>\r\n                  </div>\r\n                  <div class=\"tm-timeline-connector-vertical\"></div>\r\n                </div>\r\n\r\n\r\n\r\n\r\n                        ', 'What women say What women mean', '<p class=\"heading\">What women say What women mean</p>\r\n<p>ARE YOU WILLING TO: This means you better do it.<br /><br />FINE: This is the word women use to end an argument when they feel they are right and you need to shut up. Never use \"fine\" to describe how a woman looks. This will cause you to&nbsp;<br />have one of \"those\" arguments.<br /><br />FIVE MINUTES: This is half an hour. It is equivalent to the five minutes that your football game is going to last before you take out the trash, so it\'s an even trade.<br /><br />NOTHING: This means \"something\" and you should be on your toes. \"Nothing\" is usually used to describe the feeling a woman has of wanting to turn you inside out, upside down, and&nbsp;<br />backwards. \"Nothing\" usually signifies an argument that will last \"Five Minutes\" and will end with the word \"Fine\".<br /><br />GO AHEAD (With Raised Eyebrows): This is a dare. One that will result in a woman getting upset over \"Nothing\" and will end with the word \"Fine\".<br /><br />GO AHEAD (Normal Eyebrows): This means \"I give up\" or \"do what you want because I don\'t care\". You will get a \"Raised Eyebrow Go Ahead\" in just a few minutes, followed by&nbsp;<br />\"Nothing\" and \"Fine\", and she will talk to you in about \"Five Minutes\" when she cools off.<br /><br />LOUD SIGH: This is not actually a word, but is a non-verbal statement often misunderstood by men. A \"Loud Sigh\" means she thinks you are an idiot at that moment, and wonders why&nbsp;<br />she is wasting her time standing here arguing with you over \"Nothing\".<br /><br />SOFT SIGH: Again, not a word, but a non-verbal statement. \"Soft Sigh\" means that she is content. Your best bet is not to move or breathe, and she will stay content.<br /><br />THAT\'S OKAY: This is one of the most dangerous statements that a woman can make to a man. \"That\'s Okay\" means that she wants to think long and hard before paying you back for&nbsp;<br />whatever it is that you have done. \"That\'s Okay\" is often used with the word \"Fine\" and in conjunction with a \"Raised Eyebrow Go Ahead\". At some point in the near future, you&nbsp;<br />are going to be in some mighty big trouble.<br /><br /><br />PLEASE DO: This is not a statement, it is an offer. A woman is giving you the chance to come up with whatever excuse or reason you have for doing whatever it is that you have&nbsp;<br />done. You have a fair chance with the truth, so be careful and you shouldn\'t get a \"That\'s Okay\".<br /><br />THANKS: A woman is thanking you. Do not faint. Just say \"you\'re welcome\".<br /><br />THANKS A LOT: This is much different than \"Thanks\". A woman will say \"Thanks A Lot\" when she is really ticked off at you. It signifies that you have offended her in some callous&nbsp;<br />way, and will be followed by the \"Loud Sigh\". Be careful not to ask what is wrong after the \"Loud Sigh\" as she will only tell you \"Nothing\".</p>\r\n<p class=\"submitter\">Submitted by: Edric</p>', '2019-09-16 20:18:32', '2019-10-05 08:59:43', 21, 2, 2, 1, '127.0.0.1', '2019-09-20', 'farook', '127.0.0.1', 2),
(3, 2, 3, 'K2UPMMRDE5MXVEFMUBJYB1GEO4FGZ5RWFUS8KCYF3QSRHJFYSNTT2DS7PEPDA69BRGMS', '<div class=\"tm-timeline-item\">\r\n			        <div class=\"tm-timeline-item-inner\">\r\n			          <img src=\"https://1eu.funnyjunk.com/pictures/The_b2acb7_5599206.jpg\" alt=\"Image\" class=\"rounded-circle tm-img-timeline responsive\">\r\n			          <div class=\"tm-timeline-connector\">\r\n				          <p class=\"mb-0\">&nbsp;</p>\r\n			          </div>\r\n\r\n			    <div class=\"tm-timeline-description-wrap\">\r\n				<div class=\"tm-bg-dark-light tm-timeline-description\">\r\n            <h3 class=\"tm-text-cyan tm-font-400\">\r\n                Some Important Things Men should know about women\r\n            </h3>\r\n				    <p>Why is a Laundromat a really bad place to pick up a woman?\r\nBecause a woman who can\'t even afford a washing machine will never be able to support you.</p>\r\n\r\n            <p class=\"tm-text-yellow float-left mb-0\">Important! thing again  . \r\n              create on 9/17/2019, 7:54:43 AM\r\n            </p>\r\n<div class=\"float-right\">\r\n<a href=\"http://127.0.0.1/see-git2019/article/read/K2UPMMRDE5MXVEFMUBJYB1GEO4FGZ5RWFUS8KCYF3QSRHJFYSNTT2DS7PEPDA69BRGMS\" target=\"_blank\" style=\"color:white;font-weight:bold;\" class=\"btn btn-primary\">Read More...</a>\r\n</div>\r\n				</div>\r\n			    </div>\r\n			</div>\r\n			<div class=\"tm-timeline-connector-vertical\"></div>\r\n		    </div>\r\n\r\n        ', 'Some Important Things Men should know about women', '<p>Why is a Laundromat a really bad place to pick up a woman?<br />Because a woman who can\'t even afford a washing machine will never be able to support you.<br /><br />Why do women have smaller feet than men?<br />So they can stand closer to the sink.<br /><br />How do you know when a woman\'s about to say something smart?<br />When she starts her sentence with \"A man once told me....\"<br /><br />How do you fix a woman\'s watch?<br />You don\'t, there\'s a clock on the oven!<br /><br />Why do men pass gas more than women?<br />Because women won\'t shut up long enough to build up pressure.<br /><br />If your dog is barking at the back door and your wife is yelling at the front door, who do you let in first?<br />The dog of course, at least he\'ll shut up after you let him in!<br /><br />One golfer tells another: \"Hey, guess what? I got a set of golf clubs for my wife!\"<br />The other replies: \"GREAT trade!\"<br /><br />How many men does it take to open a beer?<br />None, it should be opened by the time she brings it in.<br /><br />What\'s worse than a Male Chauvinist Pig?<br />A woman that won\'t do what she\'s told!<br /><br />What do you call a woman with two brain cells?<br />Pregnant.</p>\r\n<p class=\"submitter\">Submitted by: Fred</p>', '2019-09-17 01:29:41', '2019-10-05 08:59:21', 14, 2, 2, 1, '127.0.0.1', '2019-09-20', 'farook', '127.0.0.1', 2),
(4, 4, 4, 'WSR3UP6TSEBGPVMRK7F4RBMHJESKOBQ9DCG2MDE5DS8MFAFM5JZTSP1GNYUYXRFF2YEU', '<div class=\"tm-timeline-item\">\r\n			        <div class=\"tm-timeline-item-inner\">\r\n			          <img src=\"https://1eu.funnyjunk.com/pictures/The_b2acb7_5599206.jpg\" alt=\"Image\" class=\"rounded-circle tm-img-timeline responsive\">\r\n			          <div class=\"tm-timeline-connector\">\r\n				          <p class=\"mb-0\">&nbsp;</p>\r\n			          </div>\r\n\r\n			    <div class=\"tm-timeline-description-wrap\">\r\n				<div class=\"tm-bg-dark tm-timeline-description\">\r\n            <h3 class=\"tm-text-yellow tm-font-400\">\r\n                Some Important Things Men should know about women\r\n            </h3>\r\n				    <p>Why is a Laundromat a really bad place to pick up a woman?\r\nBecause a woman who can\'t even afford a washing machine will never be able to support you.</p>\r\n\r\n            <p class=\"tm-text-yellow float-left mb-0\">Important!  . \r\n              create on 9/17/2019, 6:54:43 AM\r\n            </p>\r\n<div class=\"float-right\">\r\n<a href=\"http://127.0.0.1/see-git2019/article/read/WSR3UP6TSEBGPVMRK7F4RBMHJESKOBQ9DCG2MDE5DS8MFAFM5JZTSP1GNYUYXRFF2YEU\" target=\"_blank\" style=\"color:white;font-weight:bold;\" class=\"btn btn-primary\">Read More...</a>\r\n</div>\r\n				</div>\r\n			    </div>\r\n			</div>\r\n			<div class=\"tm-timeline-connector-vertical\"></div>\r\n		    </div>\r\n\r\n        ', 'A ha edit me now', '<div class=\"container tm-container-2\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"tm-welcome-text\">Some Important Things Men should know about women.</h1>\r\n</div>\r\n</div>\r\n<div class=\"row tm-section-mb\">\r\n<div class=\"col-lg-12\">\r\n<p style=\"color: black; fontweight: bold;\">All this text is generate by the default template on 9/17/2019, 6:54:43 AM</p>\r\n<p style=\"color: black; fontweight: bold;\"><img src=\"http://funnyandhumorous.com/thumb/funny-men-1.jpg\" alt=\"\" width=\"400\" height=\"303\" /></p>\r\n<p>Why is a Laundromat a really bad place to pick up a woman?<br />Because a woman who can\'t even afford a washing machine will never be able to support you.<br /><br />Why do women have smaller feet than men?<br />So they can stand closer to the sink.<br /><br />How do you know when a woman\'s about to say something smart?<br />When she starts her sentence with \"A man once told me....\"<br /><br />How do you fix a woman\'s watch?<br />You don\'t, there\'s a clock on the oven!<br /><br />Why do men pass gas more than women?<br />Because women won\'t shut up long enough to build up pressure.<br /><br />If your dog is barking at the back door and your wife is yelling at the front door, who do you let in first?<br />The dog of course, at least he\'ll shut up after you let him in!<br /><br />One golfer tells another: \"Hey, guess what? I got a set of golf clubs for my wife!\"<br />The other replies: \"GREAT trade!\"<br /><br />How many men does it take to open a beer?<br />None, it should be opened by the time she brings it in.<br /><br />What\'s worse than a Male Chauvinist Pig?<br />A woman that won\'t do what she\'s told!<br /><br />What do you call a woman with two brain cells?<br />Pregnant.</p>\r\n<p class=\"submitter\">Submitted by: Fred copy from&nbsp;<a href=\"http://funnyandhumorous.com/\">http://funnyandhumorous.com/</a></p>\r\n</div>\r\n</div>\r\n</div>', '2019-09-17 06:58:54', '2019-10-05 08:58:17', 14, 2, 2, 1, '127.0.0.1', '2019-09-20', 'farook', '127.0.0.1', 2),
(5, 10, 5, 'MWPOJTUMGJFFDKE4GBSMFSM17RKSPEBXEH8BYNUSDP2Y6GDFVZ2TQRYSFC9A5RU5R3EM', '<div class=\"tm-timeline-item\">\r\n    <div class=\"tm-timeline-item-inner\">\r\n        <img src=\"https://obs.line-scdn.net/0hi96hVTyeNhYLERktPihJQTFHNXk4fSUVbydnFVd_aCIuJSNCPnAteCgSaSckInFIYnR9ciYRLSchKXhEYHMt/w644\" alt=\"Image\" class=\"rounded-circle tm-img-timeline responsive\">\r\n        <div class=\"tm-timeline-connector\">\r\n            <p class=\"mb-0\">&nbsp;</p>\r\n        </div>\r\n\r\n        <div class=\"tm-timeline-description-wrap\">\r\n            <div class=\"tm-bg-dark-light tm-timeline-description\">\r\n                <h3 class=\"tm-text-cyan tm-font-400\">\r\n                    สาวอวบไม่ต้องกังวล อวบๆนี่แหละดี เซ็กซี่น่ามอง ส่อง \'30 แฟชั่นสาวอวบ\' จาก IG : cr5p__br\r\n                </h3>\r\n                <p>สวยระยะปลอดภัย สาวรูปร่างเซ็กซี่ขั้นสุด อวบอึ๋ม แถมหน้าตาดี อีกหนึ่งสาวที่น่า<u><b>กดติดตาม</b></u> สาวไทยที่หุ่นใกล้เคียงสาวคนนี้อย่าได้กังวลนะคะ เพราะเราไม่ได้น้อยหน้าสาวตัวเล็กผอมบาง เรามีดีในแบบที่เราควรจะมี ทั้งหน้าอก ก้น และรูปร่างโดยรวมที่แซ่บเวอร์<br><b>เธอคนนี้มาพร้อมแฟชั่นสุดเซ็กซี่ที่สาวอวบอย่างเราๆ ไม่ควรพลาด</b> วันนี้เราได้ขนเอาแฟชั่นของสาวคนนี้มาให้ชมกันถึง <b>30 แฟชั่น</b> และมีหลากหลายแบบเลยจ้า ทั้งเสื้อผ้าแฟชั่นที่เหมาะกับสาวร่างอวบ และชุดว่ายน้ำสุดแซ่บ ไปชมพร้อมๆ กันเลยค่ะ</p>\r\n\r\n                <p class=\"tm-text-cyan float-left mb-0\">\r\n                    copy from <a href=\"https://today.line.me/th/pc/article/สาวอวบไม่ต้องกังวล+อวบๆนี่แหละดี+เซ็กซี่น่ามอง+ส่อง+30+แฟชั่นสาวอวบ+จาก+IG+cr5p+br-2e645ad3876f7a3ea16c1eac718e578dfbbf69d05195a14b50f5de09ea116565\" class=\"btn btn-warning\" style=\"color:white;font-weight:bold;\" target=\"_blank\">Line Me</a> on 9/20/2019, 7:22:45 AM\r\n                </p>\r\n                \r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"tm-timeline-connector-vertical\"><br></div>\r\n</div>', 'สาวอวบไม่ต้องกังวล อวบๆนี่แหละดี เซ็กซี่น่ามอง', '<div class=\"container tm-container-2\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"tm-welcome-text\">\"สาวอวบไม่ต้องกังวล อวบๆนี่แหละดี เซ็กซี่น่ามอง\".</h1>\r\n</div>\r\n</div>\r\n<div class=\"row tm-section-mb\">\r\n<div class=\"col-lg-12\">\r\n<p>สวยระยะปลอดภัย สาวรูปร่างเซ็กซี่ขั้นสุด อวบอึ๋ม แถมหน้าตาดี อีกหนึ่งสาวที่น่า<u><strong>กดติดตาม</strong></u> สาวไทยที่หุ่นใกล้เคียงสาวคนนี้อย่าได้กังวลนะคะ เพราะเราไม่ได้น้อยหน้าสาวตัวเล็กผอมบาง เรามีดีในแบบที่เราควรจะมี ทั้งหน้าอก ก้น และรูปร่างโดยรวมที่แซ่บเวอร์<br><strong>เธอคนนี้มาพร้อมแฟชั่นสุดเซ็กซี่ที่สาวอวบอย่างเราๆ ไม่ควรพลาด</strong> วันนี้เราได้ขนเอาแฟชั่นของสาวคนนี้มาให้ชมกันถึง <strong>30 แฟชั่น</strong> และมีหลากหลายแบบเลยจ้า ทั้งเสื้อผ้าแฟชั่นที่เหมาะกับสาวร่างอวบ และชุดว่ายน้ำสุดแซ่บ ไปชมพร้อมๆ กันเลยค่ะ</p>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0h49q14Y4SaxZMSEQteW0UQXYeaHl_JHgVKH46FRAmNSJpfH5CeSgneG8YNHZkfyxIInkmcmBBcCdmcCVEJykn/w644\" alt=\"\"></div>\r\n<figcaption>เสื้อสีแดงผูกปมได้ ขาวสั้นยีนส์</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hpej_RLTHL0pXJgBxYgdQHW1wLCVkSjxJMxB-SQtIcX5yEjoeYkZnJHQhdHl5F2gUPkBiJXshNHt9HmEYPEdn/w644\" alt=\"\"></div>\r\n<figcaption>เดรสสั้นลายจุดโทนสีพื้นดำจุดขาวเล็กๆ</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0ht2hh1NNGKx1VEQQmYDRUSm9HKHJmfTgeMSd6Hgl_dSlwJT5JYHFnc3ZCcyV-JGxDOyBmeXkSMCx_KWVPPnBn/w644\" alt=\"\"></div>\r\n<figcaption>เสื้อสายเดี่ยวสีน้ำตาล มีเชือกผูกไขว้ตรงบริเวณหน้าอก ขาสั้นยีนส์ปลายขาดลุ่ย</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hjbdkC2AtNU1ZEhp2bDJKGmNENiJqfiZOPSRkTgV8a3l8JiAZbHJ8I3pHPC58JnITMHR4InUaLnxzKnsfMnN8/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เดรสรัดรูปปยีนส์ อวดทรวดทรง</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hCWTl66VtHHhpFTNDXDZjL1NDHxdaeQ97DSNNezV7QkxMIQksXHVWFkpAQ09Nd1smByRRG08RB0lDLVIqAnRW/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อสีขาวหน้าอกแหวกเห็นหมด กับขาสั้น ใครที่กลัวโป๊ก็ใส่เสื้อข้างในได้เด้อ</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hi96hVTyeNhYLERktPihJQTFHNXk4fSUVbydnFVd_aCIuJSNCPnAteCgSaSckInFIYnR9ciYRLSchKXhEYHMt/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปขาวขอบแดง กางเกงว่ายน้ำสีแดง</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hECBQVHf-Gmx_KDVXSgxlO0V-GQNMRAlvGx5LbyNGRFhaHA84SkhXAlx4Rl5aSl0yERlXD1stAV1VEFQ-FElX/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อสายเดี่ยวโทนสีอุ่น กางเกงยีนส์ขายาวเอวสูง</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hCucOsyXrHFpeNjNhaxVjDWRgHzVtWg9ZOgBNWQJYQm57AgkOa1ZWNH0yEGpwD1sEMAdROXs1B2t0DlIINVdW/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปสีแดง กางเกงขาสั้นสีดำ</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hEyDuDLq4GlZ5DDVtTCllAUNaGTlKYAlVHTpLVSViRGJcOA8CTGxWOFoEF2JTa10IFz1XMlULAWdTNFQEEm1W/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เดรสแขนกุด รัดรูปลายน้ำเงินสลับฟ้า</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hnmwcjxQWMUJKGh55fz5OFXBMMi15diJBLixgQRZ0b3ZvLiQWf3p8LGkdaXpvKHYcI3x8LWgbKnNgIn8QIXt8/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อครอปโทนสีเทา เสื้อคลุมยีนส์ และกางเกงเอวสูงผ้ามันเงา</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0h0QRwW8Ogb35vDkBFWioQKVVYbBFcYnx9Czg-fTNgMUpKOnoqWm4iEEwPMBlCPyggAT8iHUsNdE9FNiEsBG8i/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อกล้ามดำ เสื้อคลุมลายสก๊อต กางเกงยีนส์เอวสูง</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0h4rtII6yja11JMERmfBcUCnNmaDJ6XHheLQY6XhVeNWlsBH4JfFFzM2plNGljCCwDIFUgPmw1cGxjCCUPIlEl/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เดรสรัดรูปและแจ็คเก็ตยีนส์</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hzkOmqfm0JURyFAp_RyxaE0hCJitBeDZHFiJ0Ry56e3BXIDAQR3U9KlEXfHRbJGIaG3FuJ1YWPnVYLGsWGXY9/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อสีขาวแขนยาว กระโปรงทรงเอสีชมพูอ่อน</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hzQRmEOBeJX5vFApFWixaKVVCJhFceDZ9CyJ0fTN6e0pKIDAqWnU9EExAeRsRJGIgBnFuHUsXPk9FLGssBHY9/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปสีดำเน้นหน้าอก สายไขว้คอ กระโปรงยีนส์ขาดปลายเซ็กซี่มาก</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hqUkIFf-6LnpWMAFBYxNRLWxmLRVlXD15MgZ_eQpecE5zBDsuY1BkFHU2dBl7UGkkOAFjGXM3NUt8CGAoPVFk/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เปิดไหล่โทนชมพูเขียว กางเกงยีนส์เอวสูงขายาว</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hKF6R1IEbFGkLKztSPgxrPjF9FwY4Rwdqbx1FaldFSl0uHwE9PktaBygsSFx0HlM3Yk5fCi0qD1ghE1o7YEpa/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปสีขาวกับกางเกงยีนส์สั้น</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0h_7t_OcMuABhJJi8jfAV_T3NwA3d6ShMbLRBRGxVIXixsEhVMfEZKdmohXSxsREdGJxdNe28lGyljHk5KIkdK/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อยืดดำสกรีนลาย กระโปรงหนังทรงเอ แจ็คเก็ตสีเขียวขี้ม้า</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hx70vi7AaJxgNDwgjODZYTzdZJHc-YzQbaTl2G1FheSwoOzJMOG48di4OfCEjNmBGZGpsfCAOPCknN2lKZm08/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปแขนยาวสีดำ ตรงกลางเป็นรูปหัวใจ กระโปรงสั้นสีดำ</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hdY_laZp5O3ZiFRRNVzZEIVhDOBlReSh1BiNqdT57ZUJHIS4iV3VxGEEWYE9JJHwoDCR2FUYdIEdILXUkCXRx/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อสีเขียว เดรสสายเดี่ยวสีดำ</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hhY7Mx5HRN3YKNBhNPw1IITBiNBk5WCR1bgJmdVZaaUIvACIiP1UsGClhYUQjAnAoY1F8EiY9LEcgDHkkYVYs/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อคลุมฮาวายกับครอปสีขาวสายเดี่ยว กางเกงยีนส์ปลายขาด</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hhHxfG2K4N2dFHxhccDhIMH9JNAh2cyRkISlmZBlxaVNgKyIzcH95CWZIagc8KnA5LHp8BGMdLFZvJ3k1Ln55/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปสายเดี่ยวสีเทาดำ เสื้อแจ็คเก็ตเท่ๆ ขาสั้นยีนส์ปลายลุ่ย</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hyhna-VNMJkdTGAl8ZjtZEGlOJShgdDVENy53RA92eHN2LDMTZnhsKXAYLSd5eGEZPSlrJHUZPXZ5IGgVOHls/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปสีขาว คลุมลายสก๊อต กางเกงยีนส์สั้น</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hxiCkNfhHJ0Z-Egh9SzRYEUREJClNfjRFGiR2RSJ8eXJbJjISS3JoKF0SfSNWKmAYF3dsJV4SPHdUKmkUFXNo/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อครอปสีเทา เสื้อคลุมธรรมดาสีเทาอ่อนกว่า ขาสั้นโทนเทาดำ</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hREDb9-7MDWp5GyJRTD5yPUNNDgVKdx5pHS1caSV1U15cLxg-THtBBFocB1xRLko0FypADlQbFltTI0M4EnpB/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อโอเวอร์ไซส์ กับกางเกงขาสั้นปลายลุ่ย</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hvVLKBgjCKXlxMgZCRBJWLktkKhZCXjp6FQR4ei1cd01UBjwtRFJgF1JlIkAPC24nGFRkFlwzMkhbCmcrGlNg/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อโทนสีเทาเข้มยัดใส่กางเกงขาสั้นสีขาวปลายขาด</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hb1uQXaRNPR5IKBIlfQpCSXJ-PnF7RC4dLB5sHRRGYyptHChKfUh2cGt9NihkH3pAJhlwfW8gJi9iEHNMI0l2/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ครอปสายเดี่ยวโทรสีครีม เสื้อคลุมก็สีครีม กางเกงขาสั้นสีดำเอวสูง</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hamrMXK46PkJPNBF5ehJBFXViPS18WC1BKwJvQRNaYHZqACsWelRxLGwwY3Y3U3kcJlF1IWg9JXNlDHAQJFVx/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>เสื้อกล้ามลายหลากสีโทนสีน่ารักกับกางเกงยีนส์ขาสั้นปลายฉีกขาด</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hc754UcYJPBgITRMjPW5DTzIbP3c7IS8bbHttG1QjYiwteSlMPS12ditMN3oifXtGZnxxey1IJykidXJKYyx2/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ชุดว่ายน้ำโทนสีขาว</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hjnLdnWEiNUFxHRp6RD9KFktLNi5CcSZCFStkQi1za3VUKSAVRH1-L1IePHZaJXIfHyx4IlYfLnBbJXsTGnx-/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ชุดว่ายน้ำโทนสีเหลือง</figcaption>\r\n</figure>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"fig-img-wrap\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hQ_g3h80CDnBaSiFLb29xJ2AcDR9pJh1zPnxfcwYkUER_fhskbypCHnlIVUh0KkkuMyxDH3tOFUFwckAiMStC/w644\" alt=\"\">\r\n<p>&nbsp;</p>\r\n</div>\r\n<figcaption>ชุดว่ายน้ำโทนดำมาพร้อมขาสั้นยีนส์และเสื้อคลุมลายสก็อต</figcaption>\r\n</figure>\r\n<p>เรียกได้ว่าแซ่บแบบไม่รู้จบ<strong>ยังมีแฟชั่นสาวอวบอีกเยอะมากในไอจีเธอคนนี้</strong> อย่าลืมตามไปส่องกันเด้อ โดยส่วนใหญ่จากที่สังเกต <strong>ด้วยรูปร่างที่เซ็กซี่ อวบอึ๋ม ส่วนใหญ่เสื้อผ้าที่เธอเลือกใส่จะค่อนข้างรัดรูป เปิดเผยรูปร่าง คล้ายกับการอวดหุ่น</strong> ซึ่งมันเป็นเรื่องของ<u><strong>ความมั่นใจ</strong></u>ไง แล้วมันก็ดีมากๆ สำหรับสาวๆ ที่ไม่กล้า และไม่ค่อยมีความมั่นใจต้องดูเลยอ่ะ ดีจริงๆ แต่ก็ระวังๆ หน่อยนะ โลกไม่ค่อยปลอดภัยเท่าไหร่ ไปก่อนนะ สวัสดีค่ะ</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"alert alert-warning\"><a class=\"btn btn-primary\" style=\"color: red; font-weight: bold;\" href=\"https://today.line.me/th/pc/article/%E0%B8%AA%E0%B8%B2%E0%B8%A7%E0%B8%AD%E0%B8%A7%E0%B8%9A%E0%B9%84%E0%B8