(6, 9, 6, 'M75P3TERMKGUEKCROUQP6MFGYBDMH9U2ZYTBFGSANFS4MJSBR8D1ERDJSE2PFYV5WFSX', '<div class=\"tm-timeline-item\">\r\n    <div class=\"tm-timeline-item-inner\">\r\n        <img src=\"https://obs.line-scdn.net/0hDVZm5dBJG3lnFDCdwddkLl1CGBZUeAh6AyJKejt6RU0fLV5_CHpRTEscRhlNcFwnCSdQGEUSAEgadwt6WHtR/w644\" alt=\"Image\" class=\"rounded-circle tm-img-timeline responsive\">\r\n        <div class=\"tm-timeline-connector\">\r\n            <p class=\"mb-0\">&nbsp;</p>\r\n        </div>\r\n\r\n        <div class=\"tm-timeline-description-wrap\">\r\n            <div class=\"tm-bg-dark-light tm-timeline-description\">\r\n                <h3 class=\"tm-text-cyan tm-font-400\">\r\n                    รุ่นเก่าก็ต้องลดราคา! Priceza ชี้นาทีทองคนชอบของเซลล์ \"iPhone XR\" คุ้มสุดหากไม่คิดสอย \"iPhone 11\"\r\n                </h3>\r\n                <p>ประกาศเปิดตัวรุ่นใหม่ <b>iPhone 11</b>และที่น่าสนใจคือข้อมูลเชิงสถิติเกี่ยวกับการค้นหาและการซื้อของบนเว็บไซต์ <a href=\"https://www.priceza.com/article/\" target=\"_blank\"><b>Priceza.com</b></a> พบว่าในช่วงเวลา iPhone รุ่นใหม่เปิดตัวและเริ่มวางขาย ผู้ใช้จะให้ความสนใจและเลือกซื้อ iPhone รุ่นเก่า ๆ ที่ถูกปรับลดราคาลงมามากกว่า iPhone รุ่นใหม่</p>\r\n\r\n                <p class=\"tm-text-cyan float-left mb-0\">\r\n                    copy from <a href=\"https://today.line.me/th/pc/article/%E0%B8%A3%E0%B8%B8%E0%B9%88%E0%B8%99%E0%B9%80%E0%B8%81%E0%B9%88%E0%B8%B2%E0%B8%81%E0%B9%87%E0%B8%95%E0%B9%89%E0%B8%AD%E0%B8%87%E0%B8%A5%E0%B8%94%E0%B8%A3%E0%B8%B2%E0%B8%84%E0%B8%B2+Priceza+%E0%B8%8A%E0%B8%B5%E0%B9%89%E0%B8%99%E0%B8%B2%E0%B8%97%E0%B8%B5%E0%B8%97%E0%B8%AD%E0%B8%87%E0%B8%84%E0%B8%99%E0%B8%8A%E0%B8%AD%E0%B8%9A%E0%B8%82%E0%B8%AD%E0%B8%87%E0%B9%80%E0%B8%8B%E0%B8%A5%E0%B8%A5%E0%B9%8C+iPhone+XR+%E0%B8%84%E0%B8%B8%E0%B9%89%E0%B8%A1%E0%B8%AA%E0%B8%B8%E0%B8%94%E0%B8%AB%E0%B8%B2%E0%B8%81%E0%B9%84%E0%B8%A1%E0%B9%88%E0%B8%84%E0%B8%B4%E0%B8%94%E0%B8%AA%E0%B8%AD%E0%B8%A2+iPhone+11-pqna6q\" class=\"btn btn-warning\" style=\"color:white;font-weight:bold;\">Line Me</a>\r\n                    on 9/20/2019, 8:24:40 AM\r\n                </p>\r\n                \r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"tm-timeline-connector-vertical\"><br></div>\r\n</div>', 'รุ่นเก่าก็ต้องลดราคา! Priceza ชี้นาทีทองคนชอบของเซลล์ \"iPhone XR\" คุ้มสุดหากไม่คิดสอย \"iPhone 11\"', '<div class=\"container tm-container-2\">\r\n    <div class=\"row\">\r\n        <div class=\"col-lg-12\">\r\n            <h1 class=\"tm-welcome-text\">edit the title for \"รุ่นเก่าก็ต้องลดราคา! Priceza ชี้นาทีทองคนชอบของเซลล์ \"iPhone XR\" คุ้มสุดหากไม่คิดสอย \"iPhone 11\"\".</h1>\r\n        </div>\r\n    </div>\r\n    <div class=\"row tm-section-mb\">\r\n        <div class=\"col-lg-12\"><img class=\"responsive\" src=\"https://obs.line-scdn.net/0hDVZm5dBJG3lnFDCdwddkLl1CGBZUeAh6AyJKejt6RU0fLV5_CHpRTEscRhlNcFwnCSdQGEUSAEgadwt6WHtR/w644\">\r\n            <p>ประกาศเปิดตัวรุ่นใหม่ <strong>iPhone 11</strong> เอาใจสาวก apple ไปแล้ว และแน่นอนว่าเมื่อรุ่นใหม่มา iPhone รุ่นที่วางตลาดอยู่แล้วก็ต้องปรับราคาลง</p>\r\n            <p>และที่น่าสนใจคือข้อมูลเชิงสถิติเกี่ยวกับการค้นหาและการซื้อของบนเว็บไซต์ <a href=\"https://www.priceza.com/article/\" target=\"_blank\" rel=\"noopener\"><strong>Priceza.com</strong></a> พบว่าในช่วงเวลา iPhone รุ่นใหม่เปิดตัวและเริ่มวางขาย ผู้ใช้จะให้ความสนใจและเลือกซื้อ iPhone รุ่นเก่า ๆ ที่ถูกปรับลดราคาลงมามากกว่า iPhone รุ่นใหม่</p>\r\n            <figure class=\"fig-cont include-image\">\r\n                <div class=\"fig-img-wrap\"><img src=\"https://obs.line-scdn.net/0h4NejCNrca2FYE0CF_tIUNmJFaA5rf3hiPCU6YgR9NVUgKi5nN30jVHRDMVZ0dCw_NiAgAXwUcFAlcHtiZ3wj/w644\" alt=\"\" data-hashid=\"0h4NejCNrca2FYE0CF_tIUNmJFaA5rf3hiPCU6YgR9NVUgKi5nN30jVHRDMVZ0dCw_NiAgAXwUcFAlcHtiZ3wj\" data-index=\"1\"></div>\r\n                <figcaption><br></figcaption>\r\n            </figure>\r\n            <p>จากกราฟ <strong>iPhone 6s</strong> และ <strong>iPhone 6s Plus</strong> เป็นไอโฟนรุ่นที่มีจำนวนครั้งการคลิกสินค้าและมีอัตราการซื้อ (Conversion Rate) สูงที่สุด สูงกว่าจำนวนของ iPhone 8, iPhone 8 Plus, iPhone X, iPhone XR, iPhone XS และ iPhone XS Max รวมกัน</p>\r\n            <p>เพราะราคา <strong>iPhone 6s</strong> ที่ถูกปรับจนอยู่ในระดับที่เข้าถึงง่าย<strong>เหลือไม่ถึง 10,000 บาท</strong>ในบางร้านค้า แต่ก็ยังมีสเปกภาพรวมที่ตอบโจทย์ต่อการใช้งานในปัจจุบันได้ดี</p>\r\n            <p>ยิ่งไปกว่านั้นจากกราฟด้านล่างเห็นได้ชัดว่าในช่วงครึ่งปีแรกของปีนี้ ออเดอร์รวมของ <strong>iPhone 7 และ 7 Plus นั้นมีจำนวนสูงที่สุด และสูงกว่า iPhone รุ่นปี 2018 ทุกรุ่นรวมกัน</strong> ตอกย้ำที่ว่าผู้บริโภคให้ความสนใจ iPhone รุ่นเก่ามากกว่า</p>\r\n            <figure class=\"fig-cont include-image\">\r\n                <div class=\"fig-img-wrap\"><img src=\"https://obs.line-scdn.net/0hLN76_2ZME2EKTziFrI5sNjAZEA45IwBibnlCYlYhTVVydlZnZSFbVCYcTwInfFQ_ZHxYAS5MCFB3LANiNSBb/w644\" alt=\"\" data-hashid=\"0hLN76_2ZME2EKTziFrI5sNjAZEA45IwBibnlCYlYhTVVydlZnZSFbVCYcTwInfFQ_ZHxYAS5MCFB3LANiNSBb\" data-index=\"2\"></div>\r\n                <figcaption><br></figcaption>\r\n            </figure>\r\n            <p>ข้อมูลในส่วนนี้แสดงให้เห็นว่า <strong>“ราคา”</strong> ยังคงเป็นปัจจัยอันดับต้น ๆ ที่ผู้บริโภคให้ความสำคัญ โดยเฉพาะกับสมาร์ทโฟนที่ตกรุ่นช้า มีราคาขายต่อมือสองสูง และมีการรองรับอัพเดตซอฟต์แวร์ระบบเฉลี่ยถึง 5 ปี แบบ iPhone ที่ผู้ใช้แทบจะไม่มีความจำเป็นต้องเปลี่ยนเครื่องใหม่บ่อย ๆ หากตัวเครื่องยังใช้งานได้ปกติ</p>\r\n            <p>และด้วยสภาวะที่ค่าเงินบาทแข็งค่ามาก จึงน่าจะทำให้ iPhone 11 เปิดราคาขายในไทยมาได้ถูกลงมากกว่าปกติ ก็ยิ่งน่าจะส่งผลให้ไ<strong>อโฟนรุ่นเก่ามี ราคาปรับลดในอัตราที่มากขึ้นอยู่ที่ 20 – 35%</strong> อิงจากราคา <strong>iPhone 8</strong> ล่าสุดที่ประกาศออกมา ที่ร่วงจาก 23,900 บาท <strong>เหลือแค่ 15,900 บาท</strong>สำหรับความจุ 64GB&nbsp; ส่วนความจุ 128GB อยู่ที่ 17,900 บาท &nbsp;ขณะที่ <strong>iPhone 8 Plus </strong>&nbsp;<strong>19,900 บาท</strong>สำหรับความจุ 64GB และ 21,900 บาท สำหรับความจุ 128GB</p>\r\n            <p>ด้าน <strong>iPhone XR</strong> เดิมราคา 29,900 <strong>เหลือเพียง 21,900 บาท</strong> สำหรับความจุ 64GB และ 23,900 บาทสำหรับความจุ 128GB &nbsp;&nbsp;ซึ่งทำให้ iPhone XR มีความน่าสนใจมากในแง่ของความคุ้มค่าที่สเปกที่ใกล้เคียงกับ iPhone XS รุ่นสูงสุด อาทิ การกล้องหลักและชิปประมวลผลชนิดเดียวกัน &nbsp;แต่ยังมีหน้าจอที่ได้ความละเอียดน้อยกว่า เป็นต้น</p>\r\n            <p>ฉะนั้น นาทีนี้สำหรับคนที่ไม่ได้ต้องการเทคโนโลยีไฮเอนด์แบบสุดๆ ก็เป็นจังหวะที่ดีที่จะเสิร์ชและเปรียบเทียบ<strong>“สเป็ก-ราคา”</strong> เพื่อหาสิ่งที่เหมาะกับการใช้งานของตัวเองมากที่สุด</p>\r\n            \r\n            <p>\r\n                <!-- original article --> <a class=\"btn_txt\" title=\"ดูข่าวต้นฉบับ\" href=\"https://www.prachachat.net/ict/news-373293\" target=\"_blank\" rel=\"noopener\"> ดูข่าวต้นฉบับ </a></p>\r\n        </div>\r\n    </div>\r\n</div>', '2019-09-20 08:35:47', '2020-05-10 20:50:57', 21, 2, 2, 1, '127.0.0.1', '2019-09-20', 'farook', '127.0.0.1', 2),
