ullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe></p>\r\n                        <p>ความยาว 7 ชั่วโมง 14 นาที 26 วินาที</p>\r\n                        <p>&nbsp;</p>\r\n                    </li>\r\n                    <li>\r\n                        <h1 class=\"text-center\">คลิปเสียงที่ 85 ถึง 89</h1>\r\n                        <p class=\"video-container\"><iframe src=\"https://archive.org/embed/85to89\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe></p>\r\n                        <p>ความยาว 7 ชั่วโมง 11 นาที 52 วินาที</p>\r\n                        <p>&nbsp;</p>\r\n                    </li>\r\n                    <li>\r\n                        <h1 class=\"text-center\">คลิปเสียงที่ 90 ถึง 95</h1>\r\n\r\n                        <p class=\"video-container\"><iframe src=\"https://archive.org/embed/90to95\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe></p>\r\n                        <p>ความยาว 8 ชั่วโมง 40 นาที 47 วินาที</p>\r\n                        <p>&nbsp;</p>\r\n                    </li>\r\n                </ol>\r\n                <p>&nbsp;</p>\r\n                <p>วันนี้พอแค่นี้ก่อนนะครับ ผมจะมา Update ใหม่ให้อีกครั้งในวันที่ 15 ตุลาคม 2562 ครับ</p>\r\n                <p>&nbsp;</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>', '2019-09-20 12:21:04', '2020-05-09 05:54:22', 21, 2, 2, 1, '127.0.0.1', '2019-09-20', 'farook', '127.0.0.1', 2),
(9, 10, 3, '4K719DG6FAEFZBHSW2SMROTYRVYNBC5DEDMK23MGUGFYXJTREMUSUQFSE5FJRP8PBSMP', '<p><strong>Suzuki &nbsp;GSX-R1000/R \r\n&nbsp;ได้บรรจุขุมพลังเครื่องยนต์ที่ได้รับการถ่ายทอดเทคโนโลยีจากรถแข่ง GSX-RR&nbsp;\r\n MotoGP ทำให้เครื่องยนต์มีขนาดกะทัดรัดและน้ำหนักเบา \r\nโดยเป็นเครื่องยนต์แบบ DOHC 4 สูบ ซึ่งใช้ลูกสูบแบบ Forged Aluminum \r\nที่มีความแข็งแรงทนทานและน้ำหนักเบา ปริมาณกระบอกสูบ 999.8 ซีซี \r\nมีความกว้างกระบอกสูบและช่วงชัก 76 มม. X 55.1 มม. มีอัตราส่วนแรงอัดถึง \r\n13.2:1 ผสานการทำงานด้วยระบบเกียร์ 6 สปีด พร้อมระบบ Suzuki Clutch Assist \r\nSystem ที่ช่วยผ่อนแรงในการบีบมือคลัตช์และเข้าเกียร์ได้ง่ายขึ้น </strong></p><p><br></p><p><img src=\"https://i2.wp.com/www.thaisuzuki.co.th/wp-content/uploads/2018/04/HBN1.png?w=740&amp;ssl=1\" alt=\"\" style=\"width: 300px;\"><br></p><p><img src=\"https://i0.wp.com/www.thaisuzuki.co.th/wp-content/uploads/2018/04/r1000rrc.png?w=800&amp;ssl=1\" alt=\"cool boat\" style=\"width: 300px;\"></p>', 'ราคา 811,000 บาท', '<p>yes it is.</p>\r\n<p>&nbsp;</p>\r\n<p>ได้เทมเพลสด้วยนะ</p>', '2019-10-05 08:27:55', '2020-05-07 22:21:36', 21, 2, 2, 0, '', '0000-00-00', 'tee2018', '127.0.0.1', 2),
(11, 1, 11, '38RJJ92ED8FV3JSJ829DVAFFKU6JDUTE9GTJ791R63HDVPYP17EG25I0AAMI5YBO345A4WZPQKE', '<p>หลายท่านสงสัยและมีคำถามว่าเจ้า Suzuki Xbee (ครอสบี) \r\nที่เปิดตัวที่ญี่ปุ่นไปเมื่อในงานโตเกียว มอเตอร์โชว์ 2017 \r\nจะมีโอกาศเข้ามาจำหน่ายในประเทศไทยหรือไม่บอกเลยครับว่ามีโอกาสเป็นไปได้สูงมากทีเดียวครับ\r\n เพราะจากทีทราบมาทางซูซูกิ มอเตอร์ ประเทศไทย อยากทำตลาดเพิ่มด้วยรถ SUV \r\nเล็กในปี 2019 มีตัวเลือกที่น่าจับตา 2 รุ่นคือ Suzuki XBEE และ Suzuki \r\nJimny เพราะเป็นของแปลกใหม่สำหรับคนไทย<br></p><p><br></p><p><img src=\"https://www.grandprix.co.th/wp-content/uploads/2019/08/Suzuki-Xbee-8-660x400.jpg\" alt=\"test car\" style=\"width: 300px;\"></p>', 'จับตา Suzuki Xbee ว่าที่ อีโคคาร์ น้องใหม่ในไทย !!', '<p>กลับมาที่ Suzuki Xbee (ครอสบี) \r\nดีกว่าที่ผมบอกว่ามีแนวโน้มที่จะเข้ามาทำตลาดในไทยก็เพราะว่า หลังจากซูซูกิ\r\n ประสบความสำเร็จจาก Suzuki Jimny \r\nไปเรียบร้อยทำให้บริษัทแม่หันมามองตลาดในเมืองไทยมาขึ้น[expander_maker \r\nid=”4″ more=”อ่านเพิ่มเติม” less=”Read less”]Read more hidden text\r\nซึ่งอีกหนึ่งรุ่นที่ซูซูกิ มอเตอร์ ประเทศไทย เล็งไว้นั้นก็คือ Suzuki \r\nXbee เพราะทางซูซูกิ ประเทศไทย \r\nต้องการเปิดตลาดใหม่ในเซ็กเม้นท์ของอีโคคาร์อยู่แล้ว \r\nและมีแนวโน้มเป็นไปได้สูงเพราะเจ้า Suzuki Xbee \r\nมีเครื่องยนต์เบนซินไมลด์ไฮบริดแบบ 3 สูบ ขนาด 1.0 ลิตร \r\nไดเร็คอินเจคชั่นเทอร์โบ ให้กำลังสูงสุด 99 แรงม้า \r\nส่งกำลังด้วยเกียร์อัตโนมัติ 6 สปีด มีอัตราสิ้นเปลืองอยู่ที่ 22 กม./ลิตร \r\nหรือไม่ก็ยัดเครื่องยนต์อื่นๆของทางซูซูกิที่เข้ากับมาตรฐานอีโคคาร์ในเฟส2 \r\nซึ่งมันไม่ใช่เรื่องยากอะไรเพราะทางซูซูกิมีเครื่องยนต์ที่ได้รับการพัฒนาผ่านมาตรฐานอีโคคาร์เฟส\r\n 2 อยู่แล้ว &nbsp;อีกอย่างหนึ่งเพื่อนๆไม่ต้องกังวลมามันจะราคาสูงเหมือน Suzuki\r\n Jimny นะครับเพราะถ้าเจ้า Suzuki Xbee จะเข้ามาในฐานะอีโคคาร์เฟส 2 จริง \r\nนั้นก็หมายความว่าซูซูกิจะต้องผลิตเจ้า Suzuki Xbee ในประเทศไทย \r\nราคาออกมาน่ารักน่าคบหาแน่นอน\r\n&nbsp;\r\nSuzuki Xbee (ครอสบี) \r\nเป็นรถครอสโอเวอร์ขนาดเล็กที่พัฒนาขึ้นบนพื้นฐาน HEARTECH \r\nโดยผสานกันระหว่างรถอเนกประสงค์แบบแวกอนและเอสยูวีเข้าไว้ด้วยกัน \r\nรองรับการขับขี่แบบสมบุกสมบันมากกว่ารถเก๋งทั่วไป ด้วยความสูงจากพื้นถนน \r\n180 มิลลิเมตร มีห้องโดยสารกว้างขวาง สามารถบรรทุกผู้โดยสารได้ 5 ที่นั่ง<br></p><p><br></p><p><br></p><p><img src=\"https://www.grandprix.co.th/wp-content/uploads/2019/08/suzuki-Xbee.jpg\" alt=\"Car belove\" style=\"width: 300px;\"></p>', '2020-05-07 10:05:19', '2020-05-09 05:58:23', 21, 2, 2, 0, '', '0000-00-00', '', '', 2);
