(3, 'B1BTDHH5334JU0Y19DS0HR9295PFA9HOFJ4DN7YQ86A1ED9R2V3PUY6C2YROE2A8DAUYK6L8TBF', 21, 0, 4, 'Single page by Inertia.js', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12 mb-2\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://www.youtube.com/embed/JZDmBWRPWlw\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                    <br></div>\r\n                <br>\r\n            </div>\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"bg-faded\">\r\n                    <p>\r\n                        Inertia.js is a framework created by Jonathan Reinink for creating server-driven single page apps. It combines the best parts of building SPAs, while keeping the conveniences of server-driven apps. For a typical Laravel and Vue app, Inertia replaces all your blade templates with Vue Single File components allowing your application to be more interactive.\r\n\r\n                        We take a look at the basics of Inertia.js and build out a simple CRUD application in Laravel and Vue.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 'show body 25<br>', 2, '0000-00-00', '2020-04-24 00:22:09', '2020-05-02 08:56:57', 0, '', '0000-00-00'),
