(8, '', 14, 0, 11, 'edit me here', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 pt-0 mb-2\">\r\n                <a href=\"https://www.bbc.com/news/world-us-canada-51023554\" target=\"_blank\"><img src=\"https://ichef.bbci.co.uk/news/660/cpsprodpb/13134/production/_110423187_tv058995914.jpg\" alt=\"The earth the damage of it\" style=\"width: 300px;\" title=\"E-Damage\" class=\"responsive rounded\"></a>\r\n            </div>\r\n            <div class=\"col-lg-8\">\r\n                <div class=\"bg-faded rounded mb-3\">\r\n                    <p>\r\n                        This most recent quake, which began early on Tuesday morning, was the strongest in a series of quakes that have damaged Puerto Rico this week.\r\n\r\n                        Authorities say the island\'s power plants suffered some damage and power was shut off as a protective measure.\r\n\r\n                        Governor Wanda Vazquez has declared a state of emergency.\r\n\r\n                        The US Federal Emergency Management Agency is considering the governor\'s request for a federal emergency declaration. President Donald Trump has also been briefed on the earthquakes.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '', 2, '0000-00-00', '2020-04-30 09:55:48', '2020-05-01 22:16:21', 0, '', '0000-00-00'),
(10, 'OA0VYPTJJG4K7VJ2B2H249YCYAEC7497T53DJS9O9LYEOCJBHGFDA4ZEPDEA4DP8DDTQC8NB26J', 14, 0, 11, 'React Router Tutorial  by Dev Ed | 298K subscribers', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12 mb-2 pt-2\">\r\n                <div class=\"video-container\">\r\n                    <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Law7wfdg_ls\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\"></iframe>\r\n\r\n                    <br></div>\r\n\r\n                <br>\r\n            </div>\r\n            \r\n            <div class=\"col-lg-12 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center\">\r\n                    React Router Tutorial | React For Beginners\r\n                </h1>\r\n                <p>\r\n                    In this episode we are going to cover a popular react library called React Router. React Router allows us to create client side routing in our react project.<br>\r\n\r\n                    Probably one of the best thing it allows us to do is create dynamic routes and fetch api calls based on route parameters.\r\n\r\n                </p>\r\n                <ul>\r\n                    <li>\r\n                        React Router\r\n                    </li>\r\n                    <li>\r\n                        How to use the BrowserRouter, Route and Switch.\r\n                    </li>\r\n                    <li>\r\n                        How to fetch apis with react router\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <h1 class=\"text-center p-3\">No body but you cannot add! :D</h1>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '0000-00-00', '2020-04-30 16:16:12', '2020-05-02 05:28:29', 0, '', '0000-00-00'),
(11, 'BH9V57C9P8TIED3RHU0BV8YOXU6TH746JB2T2EBFDHYD6J4C5ZSMBT989W2YRT1APD3EDOO8P2J', 14, 0, 11, 'just add new item ', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            \r\n            <div class=\"col-lg-12 mb-2 pt-2\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://www.youtube.com/embed/h33Srr5J9nY\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                    <br></div>\r\n                <br>\r\n            </div>\r\n            <div class=\"col-lg-10 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center\">change the link</h1>\r\n                <p>\r\n                    Your video content text to explian what is going on in the header page here\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '', 2, '0000-00-00', '2020-05-01 05:35:37', '2020-05-02 05:24:05', 0, '', '0000-00-00'),
(12, 'C96J95A1EHA6YAA9D4A4U4DV1737ZECTX2UHATKRBV5US3F3YB4TDRLS0J74DIYP0VVI0HCR98B', 24, 14, 11, 'Bad Boys for Life (2020) คู่หูขวางนรก ตลอดกาล', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2\">\r\n                <div class=\"video-container\">\r\n                    <img src=\"https://moviebkk.com/wp-content/uploads/2020/04/Bad20Boys20for20Life2028202029.jpg\" class=\"responsive\">\r\n\r\n                </div>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center\">\r\n                    ดูหนังใหม่ Bad Boy 2020\r\n                </h1>\r\n                <p>\r\n                    Bad Boys for Life (2020) คู่หูขวางนรก ตลอดกาล รีบๆ ดูนะครับก่อนโดนลบ\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12 mb-2 pt-2\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://player.streamhee.com/play/101a6861a44e1bdf82bed7e86d75e6e3\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                </div>\r\n                <br>\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center\">\r\n                    เรื่องย่อ Bad Boys for Life (2020)\r\n                </h1>\r\n                <p>\r\n\r\n\r\n                    ไม่ว่าเวลาจะผ่านพ้นมานานสักกี่ปี มันก็ไม่ได้มีผลสะท้านสะเทือนอะไรกับมิตรภาพอันแน่นแฟ้นของคู่หูสุดซ่าต่างขั้วระหว่างเพลย์บอย ไมค์ โลว์รีย์ (วิลล์ สมิธ) กับแฟมิลี่แมน มาร์คัส เบอร์เน็ตต์ (มาร์ติน ลอว์เรนซ์) เลยแม้แต่น้อย พวกเขากำลังจะกลับมาร่วมงานกันเป็น “ครั้งสุดท้าย” เพื่อจัดการกับบุรุษตัวร้ายที่แส่มาหาเรื่องพวกเขา\r\n                </p>\r\n                <p>\r\n\r\n                    นี่เป็นการทดสอบนะครับ แค่ทดสอบระบบเท่านั้น กดดูแบบเต็มๆ จอก็ได้ ไร้โฆษณา\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '0000-00-00', '2020-05-10 15:43:17', '2020-05-10 15:43:17', 4, '49.237.20.115', '2020-05-15'),
(13, 'JYRA8BPWSE147KI4B0CE9E26RNYAVTPBH5DTGD01JAUVR4F7JSY35UC667950P8PTBYX27I9KP9', 24, 13, 11, 'ดูหนัง Terminator 6  Dark Fate (2019) คนเหล็ก 6 วิกฤตชะตาโลก ', '<!-- Title or description -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2 bg-faded rounded\">\r\n                <img src=\"https://www.doomovie-hd.com/assets/movie_poster/c/cf59932a6a8f67abbc8b2a342a39e040.png\" class=\"responsive\">\r\n                <p class=\"text-center\">\r\n                    Terminator 6 : Dark Fate (2019) คนเหล็ก 6 วิกฤตชะตาโลก\r\n                </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center\">\r\n                    Terminator 6 : Dark Fate (2019) คนเหล็ก 6 วิกฤตชะตาโลก\r\n                </h1>\r\n                <p>\r\n\r\n                    Terminator 6 : Dark Fate (2019) คนเหล็ก 6 วิกฤตชะตาโลก <br>\r\n                    Terminator ภาคใหม่ ภายใต้การกำกับของ ทิม มิลเลอร์ (Deadpool) ลินดา ฮามิลตัน ที่จะกลับมาอีกครั้งในฐานะ “ซาร่าห์ คอนเนอร์” หลังจากที่เธอปรากฏตัวครั้งล่าสุดใน Terminator 2: Judgment Day (1991) แต่ครั้งนี้เธอไม่ได้มาคนเดียว เธอยังพาฮีโร่หญิงเลือดใหม่ นาตาลี เรเยส มาแนะนำให้เราได้รู้จักในฐานะ “ดานิ รามอส” พร้อมกับ “เกรซ” นักรบหญิงจากโลกอนาคต ที่รับบทโดย แม็คเคนซี่ เดวิส อีกด้วย แน่นอนว่าตำนานคนเหล็ก อาร์โนลด์ ชวาสเซเนเกอร์ ก็จะกลับมาร่วมภารกิจครั้งนี้ด้วย โดยมี เจมส์ คาเมรอน กลับมานั่งแท่นอำนวยการสร้างร่วมกับ เดวิด แอลลิสัน อำนวยการผลิตโดย ดาน่า โกล์ดเบิร์ก, ดอน แกรนเจอร์, บอนนี่ เคอร์ติส, จูลี่ ลินน์, ทิม มิลเลอร์, จอห์น เคลลี่ และเอ็ดเวิร์ด เฉิง \r\n\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n\r\n\r\n\r\n\r\n\r\n<!-- Title or description END -->', '<!--\r\n## BODY SECTION START\r\n## Date create 2-May-2020\r\n-->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://cdn.livedoomovies.com/public/smart-tv/index.html?id=\r\nd4255bc070cd55a63010f25526871da2\" allow=\"accelerometer; autoplay; \r\nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n\r\n                </div>\r\n                <p class=\"text-center\">\r\n                    ดูหนังเรื่อง&nbsp;Terminator 6 : Dark Fate (2019) คนเหล็ก 6\r\n                            วิกฤตชะตาโลก\r\n                </p>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">\r\n                            Terminator 6 : Dark Fate (2019) คนเหล็ก 6\r\n                            วิกฤตชะตาโลก\r\n                        </h1>\r\n                        <p>\r\n                            Terminator 6 : Dark Fate (2019) คนเหล็ก 6\r\n                            วิกฤตชะตาโลก\r\n                        </p>\r\n                        <p>Terminator ภาคใหม่ ภายใต้การกำกับของ ทิม มิลเลอร์\r\n                            (Deadpool) ลินดา ฮามิลตัน ที่จะกลับมาอีกครั้งในฐานะ “ซาร่าห์ คอนเนอร์”\r\n                            หลังจากที่เธอปรากฏตัวครั้งล่าสุดใน Terminator 2: Judgment Day (1991)\r\n                            แต่ครั้งนี้เธอไม่ได้มาคนเดียว เธอยังพาฮีโร่หญิงเลือดใหม่ นาตาลี เรเยส\r\n                            มาแนะนำให้เราได้รู้จักในฐานะ “ดานิ รามอส” พร้อมกับ “เกรซ” นักรบหญิงจากโลกอนาคต\r\n                            ที่รับบทโดย แม็คเคนซี่ เดวิส อีกด้วย แน่นอนว่าตำนานคนเหล็ก อาร์โนลด์\r\n                            ชวาสเซเนเกอร์ ก็จะกลับมาร่วมภารกิจครั้งนี้ด้วย โดยมี เจมส์ คาเมรอน\r\n                            กลับมานั่งแท่นอำนวยการสร้างร่วมกับ เดวิด แอลลิสัน อำนวยการผลิตโดย ดาน่า\r\n                            โกล์ดเบิร์ก, ดอน แกรนเจอร์, บอนนี่ เคอร์ติส, จูลี่ ลินน์, ทิม มิลเลอร์, จอห์น\r\n                            เคลลี่ และเอ็ดเวิร์ด เฉิง </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- BODY SECTION END -->', 2, '0000-00-00', '2020-05-11 19:58:37', '2020-05-12 05:11:21', 10, '27.55.147.123', '2020-05-12'),
