(15, '698VM52DMHY4UAS7JZICHT8BDOUTB51J7EEI39B895FRCFQPTH46YDT83IU79E11J34AYJYYA7K', 24, 16, 0, 'ดูหนังเรื่อง Fast & Furious Presents : (2019) เร็ว...แรงทะลุนรก ฮ็อบส์ & ชอว์', '<!-- Title or description -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2 bg-faded rounded\">\r\n                <img src=\"https://img1.qunliao.info/fastdfs4/M00/D7/31/ChMf8F1dQSWAY0S7ABsaNFbNOvI067.jpg\" class=\"responsive\" alt=\"ดูหนังออนไลน์ Fast &amp; Furious Presents : (2019) เร็ว...แรงทะลุนรก ฮ็อบส์ &amp; ชอว์\">\r\n                <p class=\"text-center\">\r\n                    ดูหนังเรื่อง&nbsp;Fast &amp; Furious Presents : (2019) เร็ว...แรงทะลุนรก ฮ็อบส์ &amp; ชอว์ </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center pt-3 mb-4\">\r\n                    ดูหนังเรื่อง&nbsp;Fast &amp; Furious Presents : (2019) เร็ว...แรงทะลุนรก ฮ็อบส์ &amp; ชอว์\r\n                </h1>\r\n                <p>\r\n\r\n                    ดูหนัง&nbsp;Hobbs &amp; Shaw เป็นการกระแทกเปิดประตูใหม่สู่จักรวาล Fast เมื่อแอ็กชั่นของมันพุ่งทะยานไปทั่วโลก จากลอสแองเจลิสสู่ลอนดอน และจากเมืองร้างที่เต็มไปด้วยสารพิษอย่างเชอร์โนบิล สู่ความงามที่เขียวชอุ่มของซามัว\r\n\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<!--\r\n## BODY SECTION START\r\n## Date create 2-May-2020\r\n-->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://cdn.livedoomovies.com/public/smart-tv/index.html?id=a60e456f17ec28b59e545efbc42e3779\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                </div>\r