(17, 'I7SSDPAIA038M3CFED2T463Y24JPJR3G6579FYAPWPTE20PQ44AHRCAAVUT0JCLT6AJD1OIKTMD', 24, 20, 15, 'ดูหนัง Idiocracy อัจฉริยะผ่าโลกเพี้ยน (2006)', '<!-- Title or description -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2 bg-faded rounded\">\r\n                <img src=\"https://www.doomovie-hd.com/assets/movie_poster/1/\r\n12f4febef34904b3c48c93fd8e507b63.jpg\" class=\"responsive\" alt=\"ดูหนัง Idiocracy \r\nอัจฉริยะผ่าโลกเพี้ยน (2006)\">\r\n                <p class=\"text-center\">\r\n                    ดูหนัง Idiocracy อัจฉริยะผ่าโลกเพี้ยน (2006)\r\n                </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center pt-3 mb-4\">\r\n                    ดูหนัง Idiocracy อัจฉริยะผ่าโลกเพี้ยน (2006)\r\n                </h1>\r\n                <p>\r\n\r\n                    Idiocracy เป็นเรื่องราวในปี ค.ศ. 2505 (พ.ศ. 3048)\r\n                    เมื่อคนสติปัญญาดีเรียนจบใหม่ๆ ไม่อยากมีลูกเพราะต้องการทำงานให้ฐานะมั่นคงก่อน\r\n                    ทำให้กว่าจะมีลูกก็อายุมากแล้วตรงข้ามคนไร้การศึกษา คนไม่เรียนหนังสือ (เด็กแว๊น\r\n                    เด็กสก๊อย) กลับสนุกสนานกับการผลิตลูก จนเต็มบ้านเต็มเมือง\r\n                    เมื่อประเทศปกครองด้วยระบอบประชาธิปไตยแน่นอน กลุ่มประชากรปัญญาด้อย ย่อมมีมากกว่า\r\n                    กลุ่มประชากรปัญญาดี โหวตเลือกตั้งเมื่อไหร่ กลุ่มประชากรปัญญาด้อยก็ชนะ\r\n                    สุดท้ายเมื่อประชากรกลุ่มด้อยปัญญาเป็นผู้กำหนดสังคม… เรื่องตลกหากดูในโลกปัจจุบัน\r\n                    (แต่อาจจะเป็นเรื่องจริงในอนาคต ถ้าไม่มีการแก้ไขแต่วันนี้) ก็เกิดขึ้นที่นี่\r\n\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<!--\r\n## BODY SECTION START\r\n## Date create 2-May-2020\r\n-->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://lb1.one3up.com/public/dist/index.html?id=\r\n7e93b2d285c4a3b9c6e7fce2373a9058\" allow=\"accelerometer;  \r\nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"1008px\" height=\"597px\" frameborder=\"0\"></iframe>\r\n\r\n\r\n                </div>\r\n                <p class=\"text-center pt-2\">\r\n                    ดูหนังเรื่อง Idiocracy (2006) อัจฉริยะผ่าโลกเพี้ยน\r\n                </p>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center pt-3 mb-4\">\r\n                            ดูหนังเรื่อง Idiocracy (2006) อัจฉริยะผ่าโลกเพี้ยน\r\n                        </h1>\r\n\r\n                        <p>\r\n                            ดูหนังเรื่อง Idiocracy (2006) อัจฉริยะผ่าโลกเพี้ยน\r\n\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- BODY SECTION END -->', 2, '0000-00-00', '2020-05-17 14:10:42', '2020-05-17 14:15:12', 1101, '1.2.213.170', '2020-08-31'),
(18, 'R24KBS0DI1Y73F9FJ9BTFJ775GBK298YP2396IVDAAJETDBC3JTDY51A8A4ER1J8VZO6UEYJFC0', 24, 28, 15, 'ดูหนังเรื่อง BASTILLE DAY (2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2 bg-faded rounded\">\r\n                <img src=\"https://www.doomovie-hd.com/assets/movie_poster/c/\r\ncbba777642f4c365499279e90a931e26.jpg\" class=\"responsive\" alt=\"BASTILLE DAY \r\n(2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ\">\r\n                <p class=\"text-center\">\r\n                    ดูหนังเรื่อง BASTILLE DAY (2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ\r\n                </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center pt-3 mb-4\">\r\n                    ดูหนังเรื่อง BASTILLE DAY (2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ\r\n                </h1>\r\n                <p>\r\n\r\n                    BASTILLE DAY (2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ<br>\r\n                    เรื่องราวสองคู่หูที่อยู่กันคนละขั้วของกฏหมาย\r\n                    แต่ทว่าสถานการณ์นำให้ทั้งสองต้องจับพลัดจับผลูร่วมมือกันสืบคดีครั้งใหญ่ที่อาจนำไป\r\n                    สู่โศกนาฏกรรมของชาวปารีส ฌอน ไบรอาร์ (รับบทโดยไอดริส เอลบา)\r\n                    เจ้าหน้าที่ซีไอเอหนุ่มเลือดร้อน สุดระห่ำ ไม่เคยเกรงกลัวใครหน้าไหน และ ไมเคิล\r\n                    เมสัน (รับบทโดยริชาร์ด แมดเด้น) สิบแปดมงกุฏมือเบา อัจฉริยะด้านการล้วงกระเป๋า\r\n                    ผู้มาพร้อมกับมันสมองที่ฉลาดเป็นกรด เรื่องราวเริ่มต้นขึ้นเมื่อ ไมเคิล เมสัน\r\n                    ถูกจับกุมโดยซีไอเอในข้อหาขโมยกระเป๋าใบหนึ่งที่กลายเป็นจุดเริ่มต้นของเหตุการณ์วาง\r\n                    ระเบิดที่คร่าชีวิตผู้คนมากมายใจกลางนครปารีส ทว่าต่อมา ฌอน ไบรอาร์\r\n                    เจ้าหน้าที่ที่รับผิดชอบคดีของเมสันอยู่นั้น กลับพบว่าเมสันเป็นเพียงตัวละครเล็กๆ\r\n                    ในเกมที่ซับซ้อนกว่าที่คาดคิด\r\n                    เป็นเหตุให้ทั้งสองต้องร่วมมือกันกระชากหน้ากากผู้อยู่เบื้องหลังเหตุการณ์วินาศกรรม\r\n                    ในครั้งนี้ โดยพวกเขามีเวลาเพียง 24\r\n                    ชั่วโมงในการหยุดยั้งศัตรูและและเปิดโปงผู้ชักใยอยู่เบื้องหลังเหตุการณ์นี้\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://cdn.livedoomovies.com/public/smart-tv/index.html?id=\r\n2b96762c398024a6c2c6592fa4e47d96\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                </div>\r\n                <p class=\"text-center pt-2\">\r\n                    ดูหนังเรื่อง BASTILLE DAY (2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ\r\n                </p>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center pt-3 mb-4\">\r\n                            ดูหนังเรื่อง BASTILLE DAY (2016) ดับเบิ้ลระห่ำ\r\n                            ดับเบิ้ลระอุ\r\n                        </h1>\r\n\r\n                        <p>\r\n                            ดูหนังเรื่อง BASTILLE DAY (2016) ดับเบิ้ลระห่ำ ดับเบิ้ลระอุ\r\n\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- BODY SECTION END -->', 2, '0000-00-00', '2020-05-27 18:04:36', '2020-05-27 18:04:36', 11, '124.122.219.29', '2020-08-23'),
(19, '0P4P543J75DDAD7WY9JJ59VTJ8IV2DM789AYBTZ5UX0VFIAU3I9DT4YE6RJT88C9276ARESL11E', 24, 29, 15, 'ดูหนังเรื่อง Captain America 3 : Civil War (2016) กัปตันอเมริกา  3 ศึกฮีโร่ระห่ำโลก', '<!-- Title or description -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2 bg-faded rounded\">\r\n                <img src=\"https://www.doomovie-hd.com/assets/movie_poster/1/\r\n1ce07feb480b99e47c3cd506fa5e738c.jpg\" class=\"responsive\" alt=\"Captain America 3 \r\n: Civil War (2016) กัปตัน \r\nอเมริกา 3 ศึกฮีโร่ระห่ำโลก\">\r\n                <p class=\"text-center\">\r\n                    ดูหนังเรื่อง Captain America 3 : Civil War (2016) กัปตันอเมริกา\r\n                    3 ศึกฮีโร่ระห่ำโลก\r\n                </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center pt-3 mb-4\">\r\n                    ดูหนังเรื่อง Captain America 3 : Civil War (2016) กัปตัน\r\n                    อเมริกา\r\n                    3 ศึกฮีโร่ระห่ำโลก\r\n                </h1>\r\n                <p>\r\n\r\n                    Captain America 3 : Civil War (2016) กัปตัน อเมริกา\r\n                    3 ศึกฮีโร่ระห่ำโลก <br>\r\n                    เมื่อผลกระทบจากการปกป้องโลกของเหล่าอเวนเจอร์\r\n                    ทำให้เกิดความเสียหายมากมาย\r\n                    เหล่านักการเมืองจึงต้องการให้มีการลงทะเบียนซูเปอร์ฮีโร่\r\n                    เพื่อควบคุมเหล่าอเวนเจอร์ ซูเปอร์ฮีโร่บางส่วนเห็นด้วย\r\n                    แต่กัปตันอเมริกากลับไม่เห็นด้วย เพราะกลัวการแทรกแซงทางการเมือง ในขณะเดียวกัน\r\n                    ก็มีเหตุการณ์ก่อการร้ายเกิดขึ้นระหว่างการประชุมสนธิสัญญาจนเป็นเหตุให้กษัตริย์แห่\r\n                    งวากานด้าต้องสิ้นพระชนม์ และผู้ที่อยู่เบื้องหลังคือ เดอะ วินเทอร์ โซลเจอร์\r\n                    กัปตันอเมริกาจึงต้องปกป้องเพื่อนรักไปพร้อมๆ กับการหยุดยั้งแผนการร้ายของ บารอน\r\n                    ซีโม และยังต้องต่อสู้กับเหล่าซูเปอร์ฮีโร่ด้วยกันเอง\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<!--\r\n## BODY SECTION START\r\n## Date create 2-May-2020\r\n-->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://cdn.livedoomovies.com/public/smart-tv/index.html?id=\r\n2fd3e1db27ceef4daed838107832c88d\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                </div>\r\n                <p class=\"text-center pt-2\">\r\n                    ดูหนังเรื่อง Captain America 3 : Civil War (2016) กัปตัน อเมริกา\r\n                    3 ศึกฮีโร่ระห่ำโลก\r\n                </p>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center pt-3 mb-4\">\r\n                            ดูหนังเรื่อง Captain America 3 : Civil War (2016)\r\n                            กัปตัน อเมริกา 3 ศึกฮีโร่ระห่ำโลก\r\n                        </h1>\r\n\r\n                        <p>\r\n                            ดูหนังเรื่อง Captain America 3 : Civil War (2016) กัปตัน อเมริกา 3\r\n                            ศึกฮีโร่ระห่ำโลก\r\n\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- BODY SECTION END -->', 2, '0000-00-00', '2020-05-27 20:26:42', '2020-05-27 20:26:42', 22, '182.232.60.247', '2020-08-30');
