(10, 13, 21, 'USTD --> Picture right ', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <!-- col-lg-8 START -->\r\n            <div class=\"col-lg-8\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">\r\n                            สาวสวยอยู่ขวานะจ้ะ\r\n                        </h1>\r\n                        <p>ข้อความอะไรก็ได้ ว่าไป รูปต้องอยู่ขวามือ</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <!-- col-lg-8 END -->\r\n            <!-- col-lg-4 START -->\r\n            <div class=\"col-lg-4\">\r\n                <img src=\"https://sc01.alicdn.com/kf/HTB1P.nWPVXXXXbzaXXXq6xXFXXXq.jpg\" class=\"responsive\">\r\n                <p class=\"pt-2 text-center\">\r\n                    Last edit 15-May-2020 รูปตัวอย่าง\r\n                </p>\r\n            </div>\r\n            <!-- col-lg-4 END -->\r\n        </div>\r\n    </div>\r\n</section>', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <h1 class=\"text-center\">\r\n            No NEED Content here\r\n        </h1>\r\n    </div>\r\n</section>', '2020-05-15 08:50:39', '2020-05-15 08:50:39', 2),
(11, 15, 24, 'Watch Movie for Blog :--> BLOG TMP 19-May-2020', '<!-- Title or description -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4 mb-2 pt-2 bg-faded rounded\">\r\n                <img src=\"https://www.doomovie-hd.com/assets/movie_poster/1/\r\n12f4febef34904b3c48c93fd8e507b63.jpg\" class=\"responsive\" alt=\"ดูหนัง Idiocracy \r\nอัจฉริยะผ่าโลกเพี้ยน (2006)\">\r\n                <p class=\"text-center\">\r\n                    ดูหนัง Idiocracy อัจฉริยะผ่าโลกเพี้ยน (2006)\r\n                </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-8 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center pt-3 mb-4\">\r\n                    ดูหนัง Idiocracy อัจฉริยะผ่าโลกเพี้ยน (2006)\r\n                </h1>\r\n                <p>\r\n\r\n                    Idiocracy เป็นเรื่องราวในปี ค.ศ. 2505 (พ.ศ. 3048)\r\n                    เมื่อคนสติปัญญาดีเรียนจบใหม่ๆ ไม่อยากมีลูกเพราะต้องการทำงานให้ฐานะมั่นคงก่อน\r\n                    ทำให้กว่าจะมีลูกก็อายุมากแล้วตรงข้ามคนไร้การศึกษา คนไม่เรียนหนังสือ (เด็กแว๊น\r\n                    เด็กสก๊อย) กลับสนุกสนานกับการผลิตลูก จนเต็มบ้านเต็มเมือง\r\n                    เมื่อประเทศปกครองด้วยระบอบประชาธิปไตยแน่นอน กลุ่มประชากรปัญญาด้อย ย่อมมีมากกว่า\r\n                    กลุ่มประชากรปัญญาดี โหวตเลือกตั้งเมื่อไหร่ กลุ่มประชากรปัญญาด้อยก็ชนะ\r\n                    สุดท้ายเมื่อประชากรกลุ่มด้อยปัญญาเป็นผู้กำหนดสังคม… เรื่องตลกหากดูในโลกปัจจุบัน\r\n                    (แต่อาจจะเป็นเรื่องจริงในอนาคต ถ้าไม่มีการแก้ไขแต่วันนี้) ก็เกิดขึ้นที่นี่\r\n\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<!--\r\n## BODY SECTION START\r\n## Date create 2-May-2020\r\n-->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://lb1.one3up.com/public/dist/index.html?id=\r\n7e93b2d285c4a3b9c6e7fce2373a9058\" allow=\"accelerometer;  \r\nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"1008px\" height=\"597px\" frameborder=\"0\"></iframe>\r\n\r\n\r\n                    <br></div>\r\n                <p class=\"text-center pt-2\">\r\n                    ดูหนังเรื่อง Idiocracy (2006) อัจฉริยะผ่าโลกเพี้ยน\r\n                </p>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center pt-3 mb-4\">\r\n                            ดูหนังเรื่อง Idiocracy (2006) อัจฉริยะผ่าโลกเพี้ยน\r\n                        </h1>\r\n\r\n                        <p>\r\n                            ดูหนังเรื่อง Idiocracy (2006) อัจฉริยะผ่าโลกเพี้ยน\r\n\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- BODY SECTION END -->', '2020-05-19 03:16:24', '2020-05-19 03:16:24', 2);
