(25, '', 1, 0, 'how to set \"default_date_timezone\" in codeigniter', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4\">\r\n                <a href=\"https://lh3.googleusercontent.com/VZxQqy4qP3bjIb0W-tDxJtwmQPrUQWeIK0UtgZlWMDMu6GLk00S0HJ24AzE8Mab1fQrnOuS31FC6Qqs-zzfJ1pxGlM0aJYqxziYILRQ8EyutTKTQIvGndKERi1fk3l6OUzZmiVgVRmQ=w2400\" target=\"_blank\">\r\n                    <img src=\"https://lh3.googleusercontent.com/VZxQqy4qP3bjIb0W-tDxJtwmQPrUQWeIK0UtgZlWMDMu6GLk00S0HJ24AzE8Mab1fQrnOuS31FC6Qqs-zzfJ1pxGlM0aJYqxziYILRQ8EyutTKTQIvGndKERi1fk3l6OUzZmiVgVRmQ=w2400 \" class=\"responsive\">\r\n                </a>\r\n            </div>\r\n            <div class=\"col-lg-8\">\r\n\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">\r\n                            How to set \"date_default_timezone\" in codeigniter\r\n                        </h1>\r\n                        <p>\r\n                            simply just add on line of code in the \"index.php\"\r\n                        </p>\r\n                        <pre>date_default_timezone_set(“Asia/Bangkok”);	\r\n                        </pre>\r\n                        <p>And you\'re all done</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-04-24 11:13:40', '2020-04-24 11:15:13'),
(27, '', 1, 0, 'ฟังอัลกุรอาน ซูเราะอัลบากอรอ', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"bg-faded p-5\">\r\n                    <h1 class=\"text-center\">002 ซูเราะห์อัลบากอรอ</h1>\r\n                    <p>\r\n                        ฟังซูเราะห์อัลบากอรอ\r\n                    </p>\r\n                </div>\r\n                <div class=\"vide-container\">\r\n                    <iframe src=\"https://www.youtube.com/embed/Ra7zCdFUgrQ\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n                </div>\r\n\r\n\r\n            </div>\r\n            \r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-04-24 13:06:32', '2020-04-24 13:14:37'),
(28, '', 1, 0, 'ดุอากุนูต ละมาดก่อนตะวันขึ้น', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4\">\r\n                <img src=\"http://3.bp.blogspot.com/-GIL9Jo6g-qk/TfyqRydB1cI/AAAAAAAAAAQ/pBEXceBivVU/s80/DSCF0048.JPG\" class=\"responsive\" title=\"ผู้สอน\">\r\n            </div>\r\n            <div class=\"col-lg-8\">\r\n\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">ดุอา กุนูต</h1>\r\n                        <p> (อั้ลลอฮุมม๊ะห์ดินีฟีมันฮ่าดัย </p><p>ว่าอาฟินีฟีมันอาฟัย </p><p>ว่าตะวั้ลล่านีฟีมันตะวั้ลลัย </p><p>ว่าบาริกลีฟีมาอ๊ะตอย </p><p>ว่ากินีบิเราะห์ม่าตีก้าชัรร่อมาก่อดอย </p><p>ฟ่าอินน่าก้าตักดีว่าลายุกดออ่าลัย </p><p>ว่าอินน่าฮูลาย่าซิ้ลลุมันวาลัย </p><p>ว่าลาย่าอิสซุมันอาดัย </p><p>ต้าบาร๊อกต้าร๊อบบ่านาว่าต้าอาลัย </p><p>ฟ่าล่ากั้ลฮำดุอาลามาก้อดอย </p><p>อัสตักฟิรู้ก้าว่าอาตูบุอิลัยก้า </p><p>ว่าซ้อลลั้ลลอฮุอาลาซัยยิดินามุฮำหมัด ว่าอาลาอาลิฮีว่าเซาะห์บิฮีว่าซั้ลลำ)</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-04-25 12:29:31', '2020-04-25 12:32:17'),
(30, '', 14, 0, 'Where Vim Came From', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-8\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">\r\n                            Where Vim Came From\r\n                        </h1>\r\n                        <p>\r\n                            I recently stumbled across a file format known as Intel HEX. As far as I can gather, Intel HEX files (which use the .hex extension) are meant to make binary images less opaque by encoding them as lines of hexadecimal digits. Apparently they are used by people who program microcontrollers or need to burn data into ROM. In any case, when I opened up a HEX file in Vim for the first time, I discovered something shocking. Here was this file format that, at least to me, was deeply esoteric, but Vim already knew all about it. Each line of a HEX file is a record divided into different fields—Vim had gone ahead and colored each of the fields a different color. set ft? I asked, in awe. filetype=hex, Vim answered, triumphant.\r\n                        </p>\r\n                        <p>\r\n                            To read more in detail click on the image\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n            <div class=\"col-lg-4\">\r\n\r\n                <a href=\"https://twobithistory.org/2018/08/05/where-vim-came-from.html\" target=\"_blank\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/8/8f/Ken_Thompson_%28sitting%29_and_Dennis_Ritchie_at_PDP-11_%282876612463%29.jpg\" class=\"responsive\"></a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-04-28 10:05:04', '2020-04-28 13:05:03'),
(36, '', 1, 0, 'ทนายเดชา ช๊อค ตัดงบบัตรทอง', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n\r\n\r\n                    <iframe src=\"https://www.youtube.com/embed/KqZNm6UzeHo\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n\r\n                </div>\r\n\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">&nbsp;\r\n                            ตัดงบ! บัตรทอง สุดยอดไปเลย</h1>\r\n                        <p>\r\n                            ทนายเดชา ช๊อค วิธีคิด หาเงินไปจ่ายเงินเดือนให้ข้าราชการบรรจุใหม่ #ตัดงบบัตรทอง สุดยอดไปเลย! <br></p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-04-28 22:05:12', '2020-05-02 09:00:01'),
