(46, '', 24, 0, 'What is Deno & Will it replace Node.js?', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12\">\r\n                <div class=\"video-container\">\r\n                    <iframe src=\"https://www.youtube.com/embed/3Vl8a3zYjiw\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n\r\n                </div>\r\n                <p class=\"text-center\">\r\n                    What is Deno &amp; Will it replace Node.js? | 31,905 views | •May 14, 2020\r\n                </p>\r\n\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-5\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">What is Deno &amp; Will it replace Node.js?</h1>\r\n                        <p>DenoJS is there to replace NodeJS. Or, at least, it has the goal to do so and to fix NodeJS\' biggest flaws. It\'s by the same creator (Ryan Dahl) and it comes with some pretty interesting built-in features like TypeScript support and more. Let\'s take a first look at Deno, explore it\'s key features and find out if you should make the switch.\r\n\r\n                            Also check out the article that belongs to this video: https://academind.com/learn/node-js/d...\r\n                            You find all other links (e.g. to videos mentioned in the video) in that article.\r\n\r\n                            Also have a look at our Node.js course: https://acad.link/nodejs\r\n                            Or check out all our courses: https://academind.com/learn/our-courses\r\n                        </p>\r\n                        <p class=\"pt-2 mb-3\">\r\n                            by : <a href=\"https://www.youtube.com/channel/UCSJbGtTlrDami-tDGPUV9-w\" alt=\"click to see youtube channel\" target=\"_blank\">\r\n                                Academind\r\n\r\n                            </a> 510K subscribers\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-05-15 19:27:24', '2020-05-15 19:27:24'),
