Html, CSS, JavaScript, TypeScript, Redux, Nuxt.js, RxJs,\r\n                    Bootstrap, Laravel, Node.js, Progressive Web Apps (PWA), Ionic, React Native,\r\n                    Regular Expressions (RegEx), Stencil, Power BI, Amazon Web Services (AWS),\r\n                    Firebase or other topics, make sure to have a look at this channel or at\r\n                    academind.com to find the learning resource of your choice!\r\n                </p>\r\n                <p>\r\n\r\n                    TypeScript Course for Beginners 2020 - Learn TypeScript from\r\n                    Scratch! | 164,957 views | •Jan 21, 2020\r\n\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 1, '2020-05-19 04:25:38', '2020-05-19 04:25:40'),
(55, '', 24, 25, 'ลอง Chevrolet Colorado MIDNIGHT EDITION ขับ 4 ยกสูงแต่งเต็ม  -   autolifethailand', '<!-- USTD 20-May-2020 -->\r\n<!-- Title or description -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-12 mb-2 pt-2 bg-faded rounded\">\r\n                <div class=\"video-container\">\r\n\r\n                    <iframe src=\"https://www.youtube.com/embed/1pfoh1qzukQ\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" width=\"560\" height=\"315\" frameborder=\"0\"></iframe>\r\n\r\n                    </div>\r\n                <p class=\"text-center\">\r\n                    ลอง Chevrolet Colorado MIDNIGHT EDITION ขับ 4 ยกสูงแต่งเต็ม -\r\n                    autolifethailand\r\n                </p>\r\n            </div>\r\n\r\n            <div class=\"col-lg-12 pt-0 mb-2 bg-faded rounded\">\r\n                <h1 class=\"text-center\">\r\n                    ลอง Chevrolet Colorado MIDNIGHT EDITION ขับ 4 ยกสูงแต่งเต็ม\r\n                    คุ้มน่ะ!!\r\n                </h1>\r\n                <p>\r\n                    Copy from\r\n                    <a href=\"https://www.youtube.com/channel/UCvCXZWs1uoHnph2p4Dp8Q6w\" target=\"_blank\">\r\n                        autolifethailand official\'s youtube channel\r\n                    </a>\r\n                    327K subscribers on date 20-May-2020\r\n                </p>\r\n                <p>\r\n\r\n                    autolifethailand.tv พาไปลองขับรถกระบะ Chevrolet Corolado MIDNIGHT EDITION\r\n                    ที่แต่งตัวมาเต็มๆ โดยนำรุ่น Colorado High Country แบบ 4 ประตู\r\n                    มาแต่งหน้าทาปากเพิ่ม แต่ขายในราคาแสนเร้าใจคือ\r\n                </p>\r\n                <ul class=\"list-group\">\r\n                    <li class=\"list-group-item\">\r\n                        - รุ่นขับเคลื่อนสองล้อ เกียร์อัตโนมัติ ราคา 1,028,000 บาท\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        - รุ่นขับเคลื่อนสี่ล้อ เกียร์อัตโนมัติ ราคา 1,098,000 บาท\r\n                    </li>\r\n                </ul>\r\n                <p>\r\n                    โดยรุ่นที่เรามามาลองขับคือ รุ่นท็อป ครับ\r\n                    #Chevrolet Corolado MIDNIGHT EDITION #เชฟโรเลต โคโลราโด #ลองขับเชฟโรเลต\r\n                    #autolifethailand #รีวิวรถใหม่ #ลองขับรถใหม่ #รถกระบะ #กระบะยกสูงขับ4 แต่งเต็ม\r\n                </p>\r\n                <p>\r\n                    สำหรับเจ้ารุ่นท็อปตัวนี้ จะประกอบไปด้วย\r\n                </p>\r\n                <ul class=\"list-group\">\r\n                    <li class=\"list-group-item\">\r\n                        • ภายในห้องโดยสารสีดำแบบ Jet Black พร้อมเบาะนั่งหุ้มหนังสีดำ เพิ่มความหรูหรา\r\n                        และกาบข้างประตูสีดำเงา พร้อมตราสัญลักษณ์ MIDNIGHT\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        • ยางออลเทอร์เรน (AT) ทั้งล้อหน้าและหลัง ขนาด 18 นิ้ว ใหม่!\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        • ไฟท้ายแอลอีดี ใหม่!\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        • ล้ออัลลอยสีดำ ขนาด 18 นิ้ว\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        • กระจังหน้าสีดำเงาพร้อมตราสัญลักษณ์เชฟโรเลตสีดำ\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        • กระจกมองข้าง มือจับประตู กรอบไฟหน้า สปอร์ตบาร์ ขอบหน้าต่าง\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        กันชนหลังพร้อมมือจับฝาท้ายเและซุ้มล้อ (ทั้งหมดเป็นสีดำ)\r\n                    </li>\r\n                    <li class=\"list-group-item\">\r\n                        • กระจกนิรภัยเพิ่มความเป็นส่วนตัว (Privacy Glass) สำหรับห้องโดยสารตอนหลัง 3 บาน\r\n                    </li>\r\n                </ul>\r\n                <p>\r\n                    ส่วนเครื่องยนต์ใน Chevrolet Colorado Midnight Edition นั้น\r\n                    ยังคงเป็นเครื่องยนต์ตัวเดิมคือ ดูราแม็กซ์ 4 สูบ ดีเซล เทอร์โบ 2.5 ลิตร\r\n                    ใช้ระบบเทอร์โบแปรผัน มีพละกำลัง 180 แรงม้า ที่ 3,600 รอบต่อนาที และแรงบิด 440\r\n                    นิวตันเมตร ที่รอบต่ำ 2,000 รอบต่อนาที\r\n                </p>\r\n                <p>\r\n                    มีอุปกรณ์\r\n                    ที่ช่วยลดเสียงรบกวนและแรงสั่นสะเทือนจากระบบขับเคลื่อนสู่ภายในห้องโดยสาร\r\n                    (Centrifugal Pendulum Absorber - CPA)\r\n                </p>\r\n                <p>\r\n                    จะว่าไปแล้ว Chevrolet Corolado MIDNIGHT EDITION ดูภายนอก และภายในแล้ว\r\n                    ถือว่าดุใช้ได้ครับ แต่น่าเสียดายที่ระบบความปลอดภัยที่ให้มากับรถนั้น\r\n                    น้อยไปหน่อยเมื่อเทียบกับแบรนด์คู่แข่ง\r\n                </p>\r\n                <p>\r\n                    เรามาดูกันว่า ระบบความปลอดภัยใน Chevrolet Corolado MIDNIGHT EDITION\r\n                    มีอะไรบ้าง เริ่มจาก ระบบป้องกันการลื่นไถลและล้อหมุนฟรี (TCS)\r\n                    ระบบรองรับการเบรกกะทันหัน (PBA) ระบบควบคุมการกระจายแรงเบรก (EBD)\r\n                    ระบบควบคุมเสถียรภาพการทรงตัวของรถ (ESC) ระบบควบคุมความเร็วขณะลงทางลาดชัน (HDC)\r\n                    ระบบป้องกันการไหลของรถเมื่อขึ้นทางลาดชัน (HSA) ระบบป้องกันการพลิกคว่ำ (ARP)\r\n                    และระบบควบคุมการทรงตัวขณะลากจูง (TSC)\r\n                </p>\r\n                <p>\r\n                    มีระบบแจ้งเตือนเมื่อออกจากช่องจราจร ระบบแจ้งเตือนการชนด้านหน้า\r\n                    ระบบช่วยเหลือการจอดด้านหน้าและด้านหลัง\r\n                    พร้อมกล้องมองหลังพร้อมเส้นกะระยะปรับทิศทางได้ กระจกมองหลังตัดแสงอัตโนมัติ\r\n                    ระบบเตือนการคาดเข็มขัดนิรภัยที่เบาะหลัง รวมถึงระบบตรวจวัด\r\n                    และแจ้งเตือนแรงดันลมยางที่ตรวจวัดแรงดันลมยางแต่ละล้อ\r\n                </p>\r\n                <p>\r\n                    นอกจากนี้ รถรุ่นพิเศษนี้ยังมีฟังก์ชั่นรีโมทสตาร์ท\r\n                    โดยผู้ขับขี่สามารถควบคุมการสตาร์ทเครื่องยนต์\r\n                    พร้อมสั่งการให้ระบบปรับอากาศภายในห้องโดยสารทำงานอัตโนมัติเมื่ออยู่นอกตัวรถ\r\n                    เพื่อให้ห้องโดยสารเย็นสบายก่อนขึ้นรถ\r\n                </p>\r\n                <p>\r\n                    ถามว่าน่าใช้หรือไม่ หากมองราคากับชุดแต่งแล้ว บอกได้เลยว่า \"คุ้มมาก\"\r\n                    แต่ก็ต้องดุในหลายๆ เรื่องประกอบด้วยครับ\r\n                </p>\r\n                <p>\r\n                    อย่างเช่นเรื่องของความเก่าของรถรุ่นนี้ที่ถือว่าเป็นช่วงปลายอายุแล้ว ราคาขายต่อ\r\n                    จำนวนศูนย์บริการ ที่ยังค่อนข้างเป็นรองคู่แข่งอยู่ไม่น้อย\r\n                </p>\r\n                <p>\r\n                    แต่หากคุณค้องการรถขับเคลื่อน 4 ล้อยกสูงพร้อมชุดแต่งเต็มๆ แบบนี้\r\n                    ขับไปไหนก็ได้ กำลังเครื่องยนต์ไว้ใจได้ ไม่ถึงกับซิ่งหนัก ช่วงล่างนุ่มๆ\r\n                    เหมาะกับครอบครัว ผมว่า Chevrolet Corolado MIDNIGHT EDITION\r\n                    เป็นตัวเลือกที่โคตรน่าสนใจเลยครับ\r\n                </p>\r\n                <p>\r\n\r\n                    ติดตามข่าวสารวงการยานยนต์ได้ที่ <a href=\"http://www.autolifethailand.tv\" target=\"_blank\" alt=\"ติดตาม autolifethailand ที่เวปไซต์\">WEB SITE</a>\r\n\r\n\r\n                </p>\r\n                <p>\r\n\r\n                    ลอง Chevrolet Colorado MIDNIGHT EDITION ขับ 4 ยกสูงแต่งเต็ม\r\n                    คุ้มน่ะ!! ; autolifethailand.tv | 205,088 views | •May 17, 2019\r\n\r\n\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-05-20 03:53:26', '2020-05-20 03:53:30'),
(56, '7K83U29G9M2IO3YBE9V3J42HRVQENCSLW9P7JJ4D2YZOM7SIAA824JA691J005FGJY3TC1EFE9R', 24, 26, 'โอ้คนไทยเอ๋ยรู้กันบ้างไหมว่าภาษาไทยใครทำให้วิบัติ', '<!-- ภาษาไทยใครทำให้วิบัติ -->\r\n<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <!-- col-lg-8 START -->\r\n            <div class=\"col-lg-8\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">\r\n                            ภาษาไทยใครทำให้วิบัติ\r\n                        </h1>\r\n                        <p>\r\n\r\n                            เรามาถึงวันนี้กันแล้ว\r\n                            วันที่ตัวอักษรบางตัวที่ควรจะต้องใช้ในภาษาไทย เช่น ร เรือ\r\n                            ได้หายไปแล้วในภาษาพูดของใครหลายๆ คน โดยเฉพาะกับเด็กรุ่นใหม่ที่เติบโตมาด้วย\r\n                            แทปเลต ที่แม้จะเรียนระดับมหาลัยแต่ความรู้ภาษาไทย ยังอยู่แค่ระดับเด็กอนุบาล!\r\n\r\n                        </p>\r\n                        <p>\r\n                            ยุค 3-4-5-6G เรามีเฟชบุก ไลน์ ทวิตเตอร์\r\n                            เราติดต่อกันทางโปรแกรมแชทต่างๆ\r\n                            ทำให้ชีวิตเราสะดวกสบายอยากโทรหาใครแบบเห็นหน้ากันก็ทำได้แบบฟรีๆ\r\n                            คุยกันไปซิให้หน้าจอละลายคามือ ไม่ต้องจ่ายค่าโทรศัพท์ (ถ้าโปรเนตดีๆ)\r\n                            แต่น่าเศร้าที่เราต้องพิมพ์กันแบบนี้ “ดีครัช เคๆ ขอโทด ก้อได้ ขอบจัย ฯลฯ”\r\n                            เพื่อความ ทันสมัย (หรือเพื่ออวดคนอื่นๆ ว่า “กูหลับ” ตอนเรียนวิชาภาษาไทย)\r\n                        </p>\r\n                        <p>\r\n                            หลายๆ ครั้งที่ดูรายการโทรทัศน์ ข่าว ละคร เกมโชว์\r\n                            เคยลองสังเกตุดูกันบ้างมั้ยว่า พิธีกร นักข่าวหลายๆ คนไม่สามารถออกเสียง ร เรือ ได้\r\n                            แต่จะออกเสียง ร เรือ เป็น ล ลิง แทน ฟังแล้วอนาถใจ สงสารเด็กยุค เฟชบุก ติ๊กตอก\r\n                            เหลือกำลัง ลองคุยกับคนรอบๆ ตัวคุณเป็นภาษาไทย ถ้าคุณสามารถพูดภาษาไทยได้\r\n                            คุณจะรู้ว่า เรากำลังจะเป็นเหมือนหนังเรื่อง “Idiocracy” เข้าทุกวัน เรากำลัง\r\n                            “โง่ลงๆ” ไปทุกๆวัน คนไม่ได้วิวัฒนาการมาจากลิงหรอกครับ\r\n                            แต่คนกำลังจะวิวัฒนาการไปเป็น “ลิง”\r\n\r\n                        </p>\r\n\r\n                        <p>\r\n                            ก็อย่างที่รู้ๆ\r\n                            กันนะครับว่าคนในบ้านเราส่วนใหญ่มักจะอยากผ่อนคลาย เวลาดูโทรทัศน์\r\n                            จึงเลือกดูแต่รายการที่แสนจะมีประโยชน์ เช่น ละครน้ำเน่า ข่าวดารา เกมส์โชว์\r\n                            โชว์ตุ๊ด ประกวดร้องเพลง รายการเหล่านี้ล้วนแล้วแต่มีประโยชน์ต่อชีวิตเป็นอย่างมาก\r\n                            จึงไม่น่าแปลกใจว่า ทำไมเมืองไทยถึงมีผู้ชายสวยๆ เต็มไปหมด หลายๆ\r\n                            คนสวยจนลืมไปเลยว่า “ผู้หญิงจริงๆ มีมดลูก” แน่ใจหรือเปล่าว่าแฟนสาวของคุณน่ะ\r\n                            ไม่เคยเป็น “สามี” ของใครมาก่อน อย่าเข้าใจผมผิดนะครับ ผมเองก็มีเพื่อน คนรู้จัก\r\n                            หลายๆ คน ที่เป็น “ผู้ชายสวย ผู้หญิงยืนเยี่ยว สาวสวยหุ่นดี แต่ไม่มีมดลูก”\r\n                            คนเหล่านั้นเป็นคนดี รู้จักทำมาหากิน ดีกว่าผู้ชายแท้ๆ หลายๆ คนเลยครับ แต่…\r\n                            ช่างเหอะ\r\n                        </p>\r\n\r\n                        <p>\r\n                            มันไม่ได้เป็นเรื่อง ผิดกฎหมาย หรือ พ่อใครจะตาย\r\n                            ถ้าคุณซึ่งเป็นคนไทย แต่ใช้ภาษาไทยไม่ถูกหรอกครับ แต่มันเป็นเรื่องของ “จิตสำนึก”\r\n                            ของคนๆ นึงที่ได้ชื่อว่า เป็นคนไทย สัญชาติไทย เชื้อชาติไทย แค่ไม่อยากจะ\r\n                            “ใช้ภาษาไทยที่ถูกต้อง” เอาไว้สื่อสารกับคนไทยด้วยกันก็เท่านั้นเอง\r\n                            ก็ถ้าเราที่เป็นคนไทยแท้ๆ ยังไม่สามารถจะใช้ภาษาไทยให้ถูกต้องได้แล้วต่อไป\r\n                            “เราจะพูดภาษาไทยให้ใครฟัง”\r\n                        </p>\r\n\r\n\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <!-- col-lg-8 END -->\r\n            <!-- col-lg-4 START -->\r\n            <div class=\"col-lg-4\">\r\n                <img src=\"https://i.ibb.co/cb7ft8p/th-lang.png\" class=\"responsive\" alt=\"ภาษาไทยใครทำให้วิบัติ\">\r\n                <p class=\"pt-2 text-center\">\r\n                    ภาษาไทยใครทำให้วิบัติ\r\n                </p>\r\n            </div>\r\n            <!-- col-lg-4 END -->\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-05-21 12:35:11', '2020-05-21 12:35:12'),
(57, '6540TY05VU3PQ8RM3HAA37CI5TF2AZ24AJO2D3D9J71CY877B284SJDAEKECD9P1DFBD8YJ9T6L', 24, 27, 'ขอมาอัฟจากทุกๆ ท่านและขอให้ทุกๆ ท่านมีความสุข', '<section class=\"page-section\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <!-- col-lg-8 START -->\r\n            <div class=\"col-lg-8\">\r\n                <div class=\"product-item-description d-flex mr-auto\">\r\n\r\n                    <div class=\"bg-faded p-5 rounded\">\r\n                        <h1 class=\"text-center\">อัสลามุอาลัยกุม<br>\r\n                        </h1>\r\n                        <p>ข้าพเจ้าขอมาอัฟจากทุกๆ ท่านในทุกๆ สิ่งที่ข้าพเจ้าได้ล่วงเกินท่านไม่ว่าจะ ด้วย กิริยา หรือวาจา หากว่ามันได้ทำให้ท่านต้องขุ่นข้องหมองใจ ขอท่านโปรดให้อภัยแก่ข้าพเจ้าด้วยเถิด ข้าพเจ้าขออวยพรให้ทุกๆ ท่านจงประสพแต่ความโชคดี มีความสุข ประสพความสำเร็จในแนวทางที่อัลเลาะห์รับรองด้วยเถิด&nbsp;</p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <!-- col-lg-8 END -->\r\n            <!-- col-lg-4 START -->\r\n            <div class=\"col-lg-4\">\r\n                <a href=\"https://www.see-southern.com\" target=\"_blank\"><img src=\"https://i.ibb.co/mXFSV77/far-forgive.gif\" class=\"responsive\" title=\"ขอมาอัฟด้วย\" alt=\"ขอมาอัฟและขอให้ทุกๆ ท่านมีความสุข\" style=\"width: 274px; height: 274px;\"></a>\r\n                <p class=\"pt-2 text-center\">ขอมาอัฟจากทุกๆ ท่าน<br>\r\n                </p>\r\n            </div>\r\n            <!-- col-lg-4 END -->\r\n        </div>\r\n    </div>\r\n</section>', 2, '2020-05-25 15:05:45', '2020-05-25 15:05:47');
INSERT INTO `tbl_user_status` (`st_id`, `st_uniq_id`, `st_user_id`, `kw_id`, `st_title`, `st_body`, `show_public`, `st_date_create`, `st_date_update`) VALUES
